INSERT INTO `articles_news_descs` (`articles_news_descs_id`, `articles_news_id`, `lang_code`, `article_title`, `article_body`, `created_at`, `updated_at`) VALUES
(35, 18, 'en', 'Yashvardhan Kumar Sinha - New Chief Information Commissioner', '<p>As per the RTI Act, the appointment of commissioners in the Central Information Commission is recommended by a committee comprising the prime minister (chairperson), a cabinet minister and the leader of the single largest Opposition party in the Lok Sabha.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/yashvardhan kumar sinha_1604245555.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p>The Government of India is set to appoint former Indian Foreign Service (IFS) officer and Information Commissioner Yashvardhan Kumar Sinha as the new Chief Information Commissioner.<br />\r\n<br />\r\n<strong>Appointment:</strong><br />\r\nThe commissioners are appointed by the President of India on the recommendation of a committee. As per the RTI Act, the appointment of commissioners in the Central Information Commission is recommended by a committee comprising the prime minister (chairperson), a cabinet minister and the leader of the single largest Opposition party in the Lok Sabha.</p>\r\n\r\n<p><strong>Central Information Commission at present:</strong><br />\r\nThe Central Information Commission consists of a chief and up to 10 commissioners. It has been headless twice this year and has not functioned at full strength for almost four years. Now, it has only five commissioners, leading to a backlog of 37,000 pending cases. In a February 2019 order, the Supreme Court had directed that appointments be made in a transparent and timely manner. The SC directed the government to put up all necessary information on its website, including particulars of the applicants and the composition of the search committee which shortlists candidates.</p>\r\n\r\n<p><strong>Right to Information (Amendment) Act, 2019:</strong><br />\r\n&diams; The Act amended Sections 13 and 16 of the RTI Act, 2005.&nbsp;<br />\r\n&diams; Section 13 of the original Act sets the term of the central Chief Information Commissioner and Information Commissioners at five years (or until the age of 65, whichever is earlier). The amendment changed that the appointment will be for such term as may be prescribed by the Central Government.&nbsp;<br />\r\n&diams; According to the amendment act, the salaries, allowances and other terms of service of the Chief Information Commissioner and Information Commissioners shall be such as may be prescribed by the Central Government. Previously it was equivalent to that of the Chief Election Commissioner and Election Commissioners respectively.<br />\r\n&diams; The government said that the amendment was required because the election commission is a Constitutional body while the information commission, formed under the Right to Information Act, is a statutory one.</p>', NULL, '2020-11-01 21:35:07'),
(36, 18, 'hi', 'यशवर्धन कुमार सिन्हा - नए मुख्य सूचना आयुक्त', '<h2><strong>यशवर्धन कुमार सिन्हा - नए मुख्य सूचना आयुक्त</strong></h2>\r\n\r\n<p><br />\r\nआरटीआई अधिनियम के अनुसार, केंद्रीय सूचना आयोग में आयुक्तों की नियुक्ति की सिफारिश एक समिति द्वारा की जाती है जिसमें प्रधानमंत्री (अध्यक्ष), एक कैबिनेट मंत्री और लोकसभा में सबसे बड़े विपक्षी दल के नेता शामिल होते हैं।</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/yashvardhan kumar sinha_1604245777.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p>भारत सरकार पूर्व भारतीय विदेश सेवा (IFS) अधिकारी और सूचना आयुक्त यशवर्धन कुमार सिन्हा को नए मुख्य सूचना आयुक्त के रूप में नियुक्त करने के लिए तैयार है।</p>\r\n\r\n<p><strong>नियुक्ति:</strong><br />\r\nआयुक्तों की नियुक्ति भारत के राष्ट्रपति द्वारा एक समिति की सिफारिश पर की जाती है। आरटीआई अधिनियम के अनुसार, केंद्रीय सूचना आयोग में आयुक्तों की नियुक्ति की सिफारिश एक समिति द्वारा की जाती है जिसमें प्रधानमंत्री (अध्यक्ष), एक कैबिनेट मंत्री और लोकसभा में सबसे बड़े विपक्षी दल के नेता शामिल होते हैं।</p>\r\n\r\n<p><strong>वर्तमान में केंद्रीय सूचना आयोग:</strong><br />\r\nकेंद्रीय सूचना आयोग में एक मुख्य और 10 आयुक्त होते हैं। यह इस साल दो बार बिना सिर के रहा है और लगभग चार साल तक पूरी ताकत से काम नहीं किया है। अब, इसके पास केवल पांच आयुक्त हैं, जो 37,000 लंबित मामलों के बैकलॉग के कारण हैं। फरवरी 2019 के एक आदेश में, सुप्रीम कोर्ट ने निर्देश दिया था कि नियुक्तियाँ पारदर्शी और समयबद्ध तरीके से की जाएँ। SC ने सरकार को निर्देश दिया कि वह अपनी वेबसाइट पर सभी आवश्यक जानकारी डालें, जिसमें आवेदकों के विवरण और खोज समिति की संरचना शामिल है जो उम्मीदवारों को शॉर्टलिस्ट करती है।</p>\r\n\r\n<p><strong>सूचना का अधिकार (संशोधन) अधिनियम, 2019:</strong></p>\r\n\r\n<p>- अधिनियम ने आरटीआई अधिनियम, 2005 की धारा 13 और 16 में संशोधन किया।</p>\r\n\r\n<p>- मूल अधिनियम की धारा 13 में केंद्रीय मुख्य सूचना आयुक्त और सूचना आयुक्तों का कार्यकाल पांच वर्ष (या 65 वर्ष की आयु तक, जो भी पहले हो) निर्धारित किया गया है। संशोधन ने कहा कि नियुक्ति ऐसे पद के लिए होगी जैसा कि केंद्र सरकार द्वारा निर्धारित किया जा सकता है।</p>\r\n\r\n<p>- संशोधन अधिनियम के अनुसार, मुख्य सूचना आयुक्त और सूचना आयुक्तों के वेतन, भत्ते और अन्य शर्तें केंद्र सरकार द्वारा निर्धारित की जा सकती हैं। पहले यह मुख्य चुनाव आयुक्त और चुनाव आयुक्तों के समकक्ष था।</p>\r\n\r\n<p>- सरकार ने कहा कि संशोधन की आवश्यकता थी क्योंकि चुनाव आयोग एक संवैधानिक निकाय है जबकि सूचना का अधिकार अधिनियम के तहत गठित सूचना आयोग एक वैधानिक है।</p>', NULL, '2020-11-01 21:35:07'),
(37, 19, 'en', 'Khadi Commission launches \'Happy Diwali\' printed face masks  Khadi Commission launches \'Happy Diwali\' printed face masks', '<p>The Diwali Muslin face masks are priced nominally at 75 rupees a piece and are available for sale through the Khadi outlets in Delhi and online through KVICs e-portal www.khadiindia.gov.in.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/Diwli_1604246488.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p>Khadi and Village Industries Commission (KVIC) has launched a Limited Edition of two-layered &quot;Happy Diwali&quot; printed face masks - high quality and ultra-fine cotton fabric handmade by traditional Khadi artisans of West Bengal.</p>\r\n\r\n<p><strong>Highlights:</strong></p>\r\n\r\n<ul>\r\n	<li>The Diwali Muslin face masks are priced nominally at 75 rupees a piece and are available for sale through the Khadi outlets in Delhi and online through KVIC&rsquo;s e-portal www.khadiindia.gov.in.&nbsp;</li>\r\n	<li>Like the other variants of Khadi face masks, the Muslin face masks too are skin-friendly, washable, reusable and bio-degradable and economical that suits all pockets. Traditional Khadi artisans make these handmade masks of West Bengal.</li>\r\n	<li>The sparkling red piping on the masks adds to the style to the look as it has been designed to gel with the festive attires.</li>\r\n	<li>Amid protecting people from the spread of covid -19, KVIC is working to make its face masks look trendier. These Muslin fabric face masks have added variety to the range of face masks that also include Cotton and Silk masks.</li>\r\n	<li>The Muslin face masks have been developed following the overwhelming public response to two layers Khadi Cotton and three layers of silk masks. Ministry of Micro, Small and Medium Enterprises - So far KVIC has sold over 18 lakh such face masks across the country in less than six months.</li>\r\n	<li>KVIC will also launch Christmas and New Year special masks in the coming days.</li>\r\n</ul>', NULL, '2020-11-01 21:43:05'),
(38, 19, 'hi', 'खादी आयोग ने शुरू किया \'हैप्पी दिवाली\' प्रिंटेड फेस मास्क खादी कमीशन ने लॉन्च किया \'हैप्पी दिवाली\' प्रिंटेड फेस मास्क', '<p>दिवाली मसलिन फेस मास्क की कीमत नाममात्र 75 रुपये प्रति पीस है और यह दिल्ली में खादी आउटलेट्स और ऑनलाइन केवीआईसी ई-पोर्टल www.khadiindia.gov.in के माध्यम से बिक्री के लिए उपलब्ध है।</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/Diwli_1604246629.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p>खादी और ग्रामोद्योग आयोग (KVIC) ने पश्चिम बंगाल के पारंपरिक खादी कारीगरों द्वारा दो स्तरीय &quot;हैप्पी दिवाली&quot; प्रिंटेड फेस मास्क - उच्च गुणवत्ता और अल्ट्रा-फाइन कॉटन फैब्रिक का सीमित संस्करण लॉन्च किया है।</p>\r\n\r\n<p>मुख्य विशेषताएं:<br />\r\n- दिवाली मसलिन फेस मास्क की कीमत 75 रुपये प्रति पीस है और यह दिल्ली के खादी आउटलेट्स और केवीआईसी के ई-पोर्टल www.khadiindia.gov.in के माध्यम से ऑनलाइन बिक्री के लिए उपलब्ध है।</p>\r\n\r\n<p>- खादी फेस मास्क के अन्य वेरिएंट की तरह, मसलिन फेस मास्क भी त्वचा के अनुकूल, धोने योग्य, पुन: प्रयोज्य और जैव-अपमानजनक और किफायती हैं जो सभी जेबों पर सूट करते हैं। पारंपरिक खादी कारीगर पश्चिम बंगाल के इन हस्तनिर्मित मुखौटों को बनाते हैं।</p>\r\n\r\n<p>- मास्क पर स्पार्कलिंग रेड पाइपिंग स्टाइल को लुक में जोड़ता है क्योंकि इसे फेस्टिव अटायर के साथ जेल करने के लिए डिजाइन किया गया है।</p>\r\n\r\n<p>- लोगों को कोविद -19 के प्रसार से बचाने के लिए, KVIC अपने फेस मास्क को ट्रेंडी बनाने के लिए काम कर रहा है। इन मलमल फैब्रिक फेस मास्क ने विभिन्न प्रकार के फेस मास्क शामिल किए हैं जिनमें कॉटन और सिल्क मास्क भी शामिल हैं।</p>\r\n\r\n<p>- दो लेयर्स खादी कॉटन और सिल्क लेयर्स की तीन लेयर्स के लिए लोगों की जबरदस्त प्रतिक्रिया के बाद मलमल फेस मास्क विकसित किया गया है। सूक्ष्म, लघु और मध्यम उद्योग मंत्रालय - अब तक KVIC ने छह महीने से भी कम समय में देश भर में ऐसे 18 लाख से अधिक फेस मास्क बेचे हैं।</p>\r\n\r\n<p>- केवीआईसी आने वाले दिनों में क्रिसमस और न्यू ईयर स्पेशल मास्क भी लॉन्च करेगा।</p>', NULL, '2020-11-01 21:43:05'),
(39, 20, 'en', 'Memorandum of Understanding between India and Cambodia', '<p>The Union Cabinet approved the signing of the Memorandum of Understanding (MoU) between India and Cambodia on cooperation in the field of health and medicine on October 29, 2020.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/memorandum-of-understanding-between-india-and-cambodia_1604246977.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p>Highlights:</p>\r\n\r\n<p>1. The MoU will make cooperation strong between the two countries through joint initiatives and technology development in the health sector.</p>\r\n\r\n<p>2. The pact will become effective on the date of its signature and will remain in force for a period of five years.</p>\r\n\r\n<p>3. The main areas of cooperation between India and Cambodia include -- mother and child health, family planning, HIV/AIDS and TB, drugs and pharmaceuticals, technology transfer, public health and epidemiology, disease control (communicable and non-communicable) and medical research.</p>\r\n\r\n<p>4. It also includes development-subject to the approval of the National Ethics Committee of Cambodia and the clearance by concerned department/Ministry in India, medical education, health human resources development in the field of public health, training in clinical, para-clinical and management skills.</p>', NULL, NULL),
(40, 20, 'hi', 'भारत और कंबोडिया के बीच समझौता ज्ञापन', '<p>केंद्रीय मंत्रिमंडल ने 29 अक्टूबर, 2020 को स्वास्थ्य और चिकित्सा के क्षेत्र में सहयोग पर भारत और कंबोडिया के बीच समझौता ज्ञापन (एमओयू) पर हस्ताक्षर करने को मंजूरी दी।</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/memorandum-of-understanding-between-india-and-cambodia_1604247015.jpg\" style=\"height:337px; width:600px\" /></p>\r\n\r\n<p><strong>मुख्य विशेषताएं:</strong></p>\r\n\r\n<p>1. एमओयू स्वास्थ्य क्षेत्र में संयुक्त पहल और प्रौद्योगिकी विकास के माध्यम से दोनों देशों के बीच सहयोग को मजबूत बनाएगा।</p>\r\n\r\n<p>2. संधि उसके हस्ताक्षर की तिथि पर प्रभावी हो जाएगी और पांच साल की अवधि के लिए लागू रहेगी।</p>\r\n\r\n<p>3. भारत और कंबोडिया के बीच सहयोग के मुख्य क्षेत्रों में शामिल हैं - माँ और बाल स्वास्थ्य, परिवार नियोजन, एचआईवी / एड्स और टीबी, ड्रग्स और फार्मास्यूटिकल्स, प्रौद्योगिकी हस्तांतरण, सार्वजनिक स्वास्थ्य और महामारी विज्ञान, रोग नियंत्रण (संचारी और गैर-संचारी) चिकित्सा अनुसंधान।</p>\r\n\r\n<p>4. इसमें कंबोडिया की राष्ट्रीय आचार समिति की मंजूरी के लिए विकास-विषय और भारत में संबंधित विभाग / मंत्रालय द्वारा मंजूरी, चिकित्सा शिक्षा, सार्वजनिक स्वास्थ्य के क्षेत्र में स्वास्थ्य मानव संसाधन विकास, नैदानिक ​​में प्रशिक्षण, पैरा-क्लिनिकल भी शामिल है। और प्रबंधन कौशल।</p>', NULL, NULL);
