(89, 45, 'en', 'JEE Advanced 2020: Playing Table Tennis Helped Me To De-Stress, Says Topper Chirag Falor', '<p><strong>JEE Advanced 2020 Topper: </strong>Chirag Falor has scored 352 marks out of 396 marks in the JEE Advanced 2020 exam, held on September 27. Mr Falor, who took the entrance test from Indian Institute of Technology (IIT) <strong>Bombay zone</strong>, has secured the top rank in this year&rsquo;s JEE Advanced exam.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.digikoach.com/public/ckeditor_image/Chirag_1603042772.webp\" style=\"height:400px; width:625px\" /></p>\r\n\r\n<p>A Pune-based boy, Chirag Falor has scored 352 marks out of 396 marks in the JEE Advanced 2020 exam, held on September 27. Mr Falor, who took the entrance test from Indian Institute of Technology (IIT) Bombay zone, has secured the top rank in this year&rsquo;s JEE Advanced exam. IIT Delhi has announced the JEE Advanced 2020 result on Monday, October 5. As many as 43,204 candidates have qualified JEE Advanced 2020 this year. According to official information, there are a total of 16,053 seats available for admission to the 23 IITs in the country.</p>\r\n\r\n<p>In an interview with NDTV Education, Chirag Falor said that he used to play table tennis after lunch and dinner to destress himself during the IIT JEE Advanced preparation.</p>\r\n\r\n<p>Here&rsquo;s an excerpt from the interview:<br />\r\nWhat was your reaction upon knowing your rank?</p>\r\n\r\n<p>Chirag- I just woke up when my mother told me that I got a call from the Director of IIT Delhi that I secured the first rank. I couldn&rsquo;t believe that. I couldn&rsquo;t digest the fact at that moment. Then, I was getting calls every second, so, it was good.</p>\r\n\r\n<p>Tell us something about yourself. Which board have you studied under? Which school did you attend?</p>\r\n\r\n<p>Chirag- In Class 11 and 12, I studied in Delhi at Pragati Public School Dwarka and did my coaching from Aakash Institute.</p>\r\n\r\n<p>What is your overall and subject-wise score in JEE Advanced 2020?</p>\r\n\r\n<p>Chirag- I got 352 overall and 196 out of 198 in paper 1 and 156 out of 198 in paper 2.</p>\r\n\r\n<p>What was your JEE Main rank and marks?</p>\r\n\r\n<p>Chirag- I got 12th rank and 100 percentile</p>\r\n\r\n<p>Why do you want to study engineering? When did you decide to study engineering? Which branch would you be interested in? Any reason?</p>\r\n\r\n<p>Chirag- I am not interested in Engineering. I will be doing a Bachelor of Science in Physics.</p>\r\n\r\n<p>JEE Advanced was conducted as a computer-based test. What is your opinion about it? What preparation strategy did you adapt for the computer-based exam?</p>\r\n\r\n<p>Chirag- I actually liked the computer-based format because in the computer-based exam there is one benefit that we can change the answer because I could go back and correct my answers even if I found something wrong later on. Aakash Institute in which I studied had quite a good mock exam experience of the computer-based exam so I gave mock tests daily in my 12th standard so that helped me get all my fears away.</p>\r\n\r\n<p>When did you start your JEE Advanced 2020 preparation? Tell us something about your preparation strategy and daily routine for JEE Advanced?</p>\r\n\r\n<p>Chirag- I started my preparation in Class 9 from Pune and then I went to Delhi for better studies in Class 11 and Class 12. I completed my JEE syllabus while on Class 11 and during Class 12, I focussed more on mock tests. Mock tests helped me to practice a lot. One of the things our faculty did was error analysis for each individual student so they identified my weak topics even when I couldn&rsquo;t identify them myself so I could work only on those and that helped me a lot.</p>\r\n\r\n<p>How was the preparation for JEE Advanced 2020 different from JEE Main 2020?</p>\r\n\r\n<p>Chirag- I actually didn&rsquo;t prepare for JEE Main exam. Just before JEE Main 2020, I studied the NCERT textbooks and I majorly prepared for JEE Advanced 2020 throughout.</p>\r\n\r\n<p>How was your preparation during the pandemic? Did you face any problems during your preparation?</p>\r\n\r\n<p>Chirag- Shifting to online classes was kind of hard as we don&rsquo;t get the personal touch by studying online but I felt a one-to-one doubt session helped me in this matter.</p>\r\n\r\n<p>Mock tests and sample papers &ndash; how extensively did you practice with the help of these? Do you think practising from the previous year papers help and how?</p>\r\n\r\n<p>Chirag- Previous years&rsquo; papers helped me a lot. The week before JEE Advanced I just picked the previous years&rsquo; papers in the same manner in which I was supposed to give the exam. I was trying to mimic the same environment as the original exam so I could get the idea of the JEE Advanced exam and I could get the feeling before so I don&rsquo;t face problems in the exam. Previous years&rsquo; papers were super useful.</p>\r\n\r\n<p>Are there any special books that you feel have helped with your JEE Advanced preparation?</p>\r\n\r\n<p>Chirag- I think the book, IE Irodov of Physics problems in general physics was a very helpful book in physics because even in previous years&rsquo; JEE Advanced papers many questions from that book have been changed slightly and have been asked in the exam.</p>\r\n\r\n<p>Which subject was the easiest and which was the toughest in JEE Advanced? What do you think is a tough thing to manage during the JEE Advanced exam?</p>\r\n\r\n<p>Chirag- This year Maths was easier than the previous year. When I solved previous years&rsquo; paper, it took me 1.5 hours on Maths but during the actual day of the test, I completed the section in one hour.</p>\r\n\r\n<p>Did you face any technical glitches during the exam? What is your opinion on the way the exam was conducted?</p>\r\n\r\n<p>Chirag- I didn&rsquo;t face much technical difficulty as such but one thing I disliked that the seats which were given in paper 1 weren&rsquo;t the same which were given in paper 2. This is not what I expected in the pandemic, in paper 1 and paper 2, the seat should be the same.</p>\r\n\r\n<p>What do you think are the key factors behind your success in JEE Advanced?</p>\r\n\r\n<p>Chirag- Blessing of my teachers and parents, they helped a lot.</p>\r\n\r\n<p>How did you de-stress yourself during the preparation? What are your hobbies? How often could you pursue them?</p>\r\n\r\n<p>Chirag- I used to play table tennis after lunch and dinner so that would help in digestion and keeping my body fit. If I had some free time then I would play chess with my friend or even go for stargazing on the roof.</p>\r\n\r\n<p>Who is your ideal or biggest inspiration in life and why?</p>\r\n\r\n<p>Chirag- I just set my goals higher than what I think I could achieve and pursue that. I don&rsquo;t have any inspirational model as such.</p>\r\n\r\n<p>You know you are an inspiration to thousands of students across the country. Do you have any message for future aspirants on tackling the JEE Advanced exam?</p>\r\n\r\n<p>Chirag- One thing I will say that don&rsquo;t lose hope. The preparation can get you tired but don&rsquo;t get bored by preparation, even if it&rsquo;s lengthy then distract yourself by studying something else not by playing games and watching TV.</p>\r\n\r\n<p>Did you face any technical glitches during the exam? What is your opinion on the way the exam was conducted?</p>\r\n\r\n<p>Chirag- I didn&rsquo;t face much technical difficulty as such but one thing I disliked that the seats which were given in paper 1 weren&rsquo;t the same which were given in paper 2. This is not what I expected in the pandemic, in paper 1 and paper 2, the seat should be the same.</p>\r\n\r\n<p>What do you think are the key factors behind your success in JEE Advanced?</p>\r\n\r\n<p>Chirag- Blessing of my teachers and parents, they helped a lot.</p>\r\n\r\n<p>How did you de-stress yourself during the preparation? What are your hobbies? How often could you pursue them?</p>\r\n\r\n<p>Chirag- I used to play table tennis after lunch and dinner so that would help in digestion and keeping my body fit. If I had some free time then I would play chess with my friend or even go for stargazing on the roof.</p>\r\n\r\n<p>Who is your ideal or biggest inspiration in life and why?</p>\r\n\r\n<p>Chirag- I just set my goals higher than what I think I could achieve and pursue that. I don&rsquo;t have any inspirational model as such.</p>\r\n\r\n<p>You know you are an inspiration to thousands of students across the country. Do you have any message for future aspirants on tackling the JEE Advanced exam?</p>\r\n\r\n<p>Chirag- One thing I will say that don&rsquo;t lose hope. The preparation can get you tired but don&rsquo;t get bored by preparation, even if it&rsquo;s lengthy then distract yourself by studying something else not by playing games and watching TV.</p>', NULL, NULL),
(90, 45, 'hi', 'जेईई एडवांस 2020: प्लेइंग टेबल टेनिस ने मुझे डी-स्ट्रेस में मदद की, टॉपर चिराग फालोर कहते हैं', '<p>जेईई एडवांस्ड 2020 टॉपर: चिराग फालोर ने 27 सितंबर को आयोजित जेईई एडवांस 2020 परीक्षा में 396 में से 352 अंक हासिल किए हैं। भारतीय प्रौद्योगिकी संस्थान (आईआईटी) बॉम्बे जोन से प्रवेश परीक्षा देने वाले मिस्टर फेलर ने शीर्ष स्थान हासिल किया है। इस वर्ष के जेईई एडवांस परीक्षा में रैंक।</p>\r\n\r\n<p>27 सितंबर को आयोजित जेईई एडवांस्ड 2020 की परीक्षा में पुणे के एक लड़के, चिराग फालोर ने 396 अंकों में से 352 अंक हासिल किए हैं। श्री फालोर, जिन्होंने भारतीय प्रौद्योगिकी संस्थान (आईआईटी) बॉम्बे ज़ोन से प्रवेश परीक्षा दी थी, ने दूसरा स्थान हासिल किया था। इस साल की जेईई एडवांस परीक्षा में शीर्ष रैंक। IIT दिल्ली ने सोमवार, 5 अक्टूबर को जेईई एडवांस 2020 के परिणाम की घोषणा की है। इस साल 43,204 उम्मीदवारों ने जेईई एडवांस 2020 को क्वालिफाई किया है। आधिकारिक जानकारी के अनुसार, देश में 23 आईआईटी में प्रवेश के लिए कुल 16,053 सीटें उपलब्ध हैं।</p>\r\n\r\n<p>एनडीटीवी एजुकेशन के साथ एक साक्षात्कार में, चिराग फालोर ने कहा कि वह आईआईटी जेईई एडवांस की तैयारी के दौरान खुद को नसीब करने के लिए लंच और डिनर के बाद टेबल टेनिस खेलता था।</p>\r\n\r\n<p>यहाँ साक्षात्कार से एक अंश है:<br />\r\nआपकी रैंक जानने के बाद आपकी क्या प्रतिक्रिया थी?</p>\r\n\r\n<p>चिराग- मैं तब जाग गया जब मेरी मां ने मुझे बताया कि मुझे आईआईटी दिल्ली के निदेशक का फोन आया कि मैंने पहली रैंक हासिल की है। मैं ऐसा नहीं मान सकता। मैं उस समय इस तथ्य को पचा नहीं सकता था। तब, मुझे हर सेकंड कॉल मिल रहे थे, इसलिए, यह अच्छा था।</p>\r\n\r\n<p>आपके बारे में हमे कुछ बताईए। आपने किस बोर्ड के तहत अध्ययन किया है? आपने किस स्कूल में पढ़ाई की?</p>\r\n\r\n<p>चिराग- कक्षा 11 और 12 में, मैंने दिल्ली में प्रगति पब्लिक स्कूल द्वारका में पढ़ाई की और आकाश कोचिंग संस्थान से अपनी कोचिंग की।</p>\r\n\r\n<p>जेईई एडवांस्ड 2020 में आपका समग्र और विषयवार अंक क्या है?</p>\r\n\r\n<p>चिराग- मुझे कुल मिलाकर १ ९ paper में १ ९ paper में से १ ९ १ और पेपर २ में १ ९ got६ में से १६६ अंक मिले।</p>\r\n\r\n<p>आपकी जेईई मेन रैंक और अंक क्या थे?</p>\r\n\r\n<p>चिराग- मुझे 12 वीं रैंक मिली और 100 पर्सेंटाइल</p>\r\n\r\n<p>आप इंजीनियरिंग की पढ़ाई क्यों करना चाहते हैं? आपने इंजीनियरिंग की पढ़ाई करने का फैसला कब किया? आपको किस शाखा में रुचि होगी? कोई कारण?</p>\r\n\r\n<p>चिराग- मुझे इंजीनियरिंग में कोई दिलचस्पी नहीं है। मैं फिजिक्स में बैचलर ऑफ साइंस करूंगा।</p>\r\n\r\n<p>JEE एडवांस्ड को कंप्यूटर आधारित टेस्ट के रूप में आयोजित किया गया था। तुम्हारी इस बारे में क्या राय है? कंप्यूटर आधारित परीक्षा के लिए आपने किस तैयारी की रणनीति अपनाई?</p>\r\n\r\n<p>चिराग- मुझे वास्तव में कंप्यूटर-आधारित प्रारूप पसंद था क्योंकि कंप्यूटर-आधारित परीक्षा में एक लाभ यह है कि हम उत्तर को बदल सकते हैं क्योंकि मैं वापस जा सकता था और अपने उत्तर सही कर सकता था, भले ही मुझे बाद में कुछ गलत लगे। आकाश इंस्टीट्यूट जिसमें मैंने पढ़ाई की थी, कंप्यूटर आधारित परीक्षा का काफी अच्छा मॉक एग्जाम का अनुभव था इसलिए मैंने अपने 12 वीं कक्षा में रोजाना मॉक टेस्ट दिए ताकि मुझे अपने सारे डर दूर हो जाएं।</p>\r\n\r\n<p>आपने अपनी जेईई एडवांस्ड 2020 की तैयारी कब शुरू की? जेईई एडवांस के लिए अपनी तैयारी की रणनीति और दैनिक दिनचर्या के बारे में कुछ बताएं?</p>\r\n\r\n<p>चिराग- मैंने पुणे से कक्षा 9 में अपनी तैयारी शुरू की और फिर कक्षा 11 और कक्षा 12 में बेहतर पढ़ाई के लिए दिल्ली चला गया। मैंने कक्षा 11 में रहते हुए अपना जेईई पाठ्यक्रम पूरा किया और कक्षा 12 के दौरान, मैंने मॉक टेस्ट पर अधिक ध्यान केंद्रित किया। मॉक टेस्ट से मुझे काफी अभ्यास करने में मदद मिली। हमारे संकाय ने जिन चीजों का विश्लेषण किया, उनमें से प्रत्येक व्यक्ति के लिए त्रुटि विश्लेषण था, इसलिए उन्होंने मेरे कमजोर विषयों की पहचान की, तब भी जब मैं उन्हें अपनी पहचान नहीं देता था, इसलिए मैं केवल उन पर काम कर सकता था और इससे मुझे बहुत मदद मिली।</p>\r\n\r\n<p>जेईई मेन 2020 से अलग जेईई एडवांस 2020 की तैयारी कैसी थी?</p>\r\n\r\n<p>चिराग- मैंने वास्तव में जेईई मेन परीक्षा की तैयारी नहीं की है। जेईई मेन 2020 से ठीक पहले, मैंने एनसीईआरटी की पाठ्यपुस्तकों का अध्ययन किया और मैंने जेईई एडवांस 2020 के लिए पूरी तैयारी की।</p>\r\n\r\n<p>महामारी के दौरान आपकी तैयारी कैसी थी? क्या आपको अपनी तैयारी के दौरान किसी समस्या का सामना करना पड़ा?</p>\r\n\r\n<p>चिराग- ऑनलाइन क्लासों में शिफ्ट करना बहुत कठिन था क्योंकि ऑनलाइन पढ़ाई करने से हमें पर्सनल टच नहीं मिलता था, लेकिन मुझे लगा कि एक-से-एक संदेह सत्र ने इस मामले में मेरी मदद की।</p>\r\n\r\n<p>मॉक टेस्ट और सैंपल पेपर - आपने इनकी मदद से कितने बड़े पैमाने पर अभ्यास किया? क्या आपको लगता है कि पिछले वर्ष के प्रश्नपत्रों से अभ्यास करना मदद करता है और कैसे?</p>\r\n\r\n<p>चिराग- पिछले वर्षों के कागजात ने मुझे बहुत मदद की। जेईई एडवांस से एक सप्ताह पहले मैंने पिछले वर्षों के प्रश्नपत्र उसी तरह से चुने थे जिसमें मैं परीक्षा देने वाला था। मैं मूल परीक्षा के समान माहौल की नकल करने की कोशिश कर रहा था, ताकि मुझे जेईई एडवांस परीक्षा का विचार मिल सके और मुझे परीक्षा में समस्याओं का सामना न करना पड़े, इससे पहले ही मैं यह महसूस कर सकता था। पिछले वर्षों के कागजात सुपर उपयोगी थे।</p>\r\n\r\n<p>क्या आपकी जेईई एडवांस की तैयारी में आपकी मदद करने वाली कोई विशेष पुस्तकें हैं?</p>\r\n\r\n<p>चिराग- मुझे लगता है कि सामान्य भौतिकी में भौतिकी समस्याओं में IE इरोडोव की पुस्तक, भौतिकी में एक बहुत ही सहायक पुस्तक थी क्योंकि पिछले वर्षों के जेईई के उन्नत पेपरों में भी उस पुस्तक के कई प्रश्नों को थोड़ा बदल दिया गया है और परीक्षा में पूछा गया है।</p>\r\n\r\n<p>कौन सा विषय सबसे आसान था और जेईई एडवांस में सबसे कठिन कौन सा था? आपको क्या लगता है कि जेईई एडवांस परीक्षा के दौरान प्रबंधन करना एक कठिन बात है?</p>\r\n\r\n<p>चिराग- इस साल मैथ्स पिछले साल की तुलना में आसान था। जब मैंने पिछले वर्षों के पेपर हल किए, तो मुझे मैथ्स में 1.5 घंटे लगे लेकिन टेस्ट के वास्तविक दिन के दौरान, मैंने एक घंटे में सेक्शन पूरा किया।</p>\r\n\r\n<p>क्या आपको परीक्षा के दौरान किसी तकनीकी खराबी का सामना करना पड़ा? परीक्षा आयोजित करने के तरीके पर आपकी क्या राय है?</p>\r\n\r\n<p>चिराग- मुझे इस तरह की तकनीकी कठिनाई का सामना नहीं करना पड़ा, लेकिन एक बात मुझे बहुत नापसंद थी कि जो सीटें पेपर 1 में दी गई थीं, वही नहीं थीं, जो पेपर 2 में दी गई थीं। यह वह नहीं है जिसकी मुझे महामारी की उम्मीद थी, कागज में 1 और पेपर 2, सीट समान होनी चाहिए।</p>\r\n\r\n<p>आपको क्या लगता है कि जेईई एडवांस में आपकी सफलता के पीछे प्रमुख कारक क्या हैं?</p>\r\n\r\n<p>चिराग- मेरे शिक्षकों और माता-पिता का आशीर्वाद, उन्होंने बहुत मदद की।</p>\r\n\r\n<p>तैयारी के दौरान आपने खुद को कैसे तनाव मुक्त किया? आपके शौक क्या हैं? आप कितनी बार उनका पीछा कर सकते हैं?</p>\r\n\r\n<p>चिराग- मैं लंच और डिनर के बाद टेबल टेनिस खेलता था ताकि पाचन और मेरे शरीर को फिट रखने में मदद मिले। अगर मेरे पास कुछ खाली समय होता तो मैं अपने दोस्त के साथ शतरंज खेलता या यहां तक ​​कि छत पर घूरने के लिए जाता।</p>\r\n\r\n<p>आपके आदर्श या जीवन में सबसे बड़ी प्रेरणा कौन है और क्यों?</p>\r\n\r\n<p>चिराग- मैंने अभी अपने लक्ष्य इससे ज्यादा तय किए हैं जो मुझे लगता है कि मैं इसे हासिल कर सकता हूं और आगे बढ़ा सकता हूं। मेरे पास ऐसा कोई प्रेरणादायक मॉडल नहीं है।</p>\r\n\r\n<p>आप जानते हैं कि आप देश भर के हजारों छात्रों के लिए एक प्रेरणा हैं। क्या आपके पास जेईई एडवांस परीक्षा से निपटने के लिए भविष्य के उम्मीदवारों के लिए कोई संदेश है?</p>\r\n\r\n<p>चिराग- एक बात मैं कहूंगा कि उम्मीद मत हारो। तैयारी आपको थका सकती है, लेकिन तैयारी से ऊब नहीं है, भले ही यह लंबा हो और कुछ और खेल का अध्ययन करके और टीवी देखकर खुद को विचलित न करें।</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL),
(91, 46, 'en', 'JEE Blog', '<pre>\r\n<em><strong>The National Testing Agency released new guidelines on Tuesday to make the JEE-NEET examinations safe and calm the candidates&#39; fears.</strong></em></pre>\r\n\r\n<pre>\r\nThe National Testing Agency released new guidelines on Tuesday to make the JEE-NEET examinations safe and calm the candidates&#39; fears.\r\n</pre>', NULL, NULL),
(92, 46, 'hi', 'जेईई ब्लॉग', '<p><strong>नेशनल टेस्टिंग एजेंसी (एनटीए) ने जेईई-नीट की परीक्षाओं को सुरक्षित बनाने और अभ्यर्थियों की आशंकाओं को शांत करने के लिए मंगलवार को नए दिशानिर्देश जारी</strong></p>\r\n\r\n<p>नेशनल टेस्टिंग एजेंसी (एनटीए) ने जेईई-नीट की परीक्षाओं को सुरक्षित बनाने और अभ्यर्थियों की आशंकाओं को शांत करने के लिए मंगलवार को नए दिशानिर्देश जारी</p>', NULL, NULL),
(93, 47, 'en', '5 Key things regarding National Education Policy 2020', '<p>2020, the year characterized by uncertainty. Years down the line we shall remember how the world changed this year and life came to a standstill. We have witnessed major unprecedented events till now, with one leading to the other and we are still not done yet. But one of the changes which was not only anticipated but rather necessary came about in the form of the National Education Policy 2020 in India, and happens to be one of the major positive breakthroughs of this otherwise dreadful start of the decade</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The National Education Policy 2020 has been introduced at the right time, to complement the process and vision of creating quality institutions, a culture of innovation, and a highly skilled workforce. It was about time that we initiated a process to transform the Educational Institutions in India, and provide them the ability to attain a certain level, that they can be compared to the likes of the best in the world.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is a landmark change by the Indian Government, as they have replaced the 34-year-old National Policy on Education, which was framed in 1986, with the New Education Policy of 2020. The NEP, which has been approved by the union cabinet, has made revolutionary reforms in the Indian education paradigm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Instating a single regulator for higher education institutions, the scheme of multiple entry and exit options in degree courses, the low stakes board exams, and common entrance exams for universities, these are some of the key takeaways from this exciting new policy. Each of these reforms reflect on the fact that how India has evolved as an economy, and how we are prepared to be recognized as a force to reckon with. The Education system of a country is a true indicator of its economic strength, and the reforms of the NEP 2020, will certainly help India break into the top three economies of the world in the next 10 years.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Some of the Major Highlights of the National Education Policy 2020 are:</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong><strong>Schooling to begin from the age of 3 years:</strong></strong><br />\r\n	The revised policy expands the age group of mandatory schooling from 6-14 years to 3-18 years. This new system will include 12 years of schooling with three years of Anganwadi/ pre-schooling. The existing 10+2 structure of school curriculum will be replaced by a 5+3+3+4 curricular structure corresponding to ages 3-8, 8-11, 11-14, and 14-18 years respectively.</p>\r\n	</li>\r\n	<li><strong><strong>Mother tongue to be instated as medium of instruction:</strong></strong><br />\r\n	The National education policy 2020 has directed focus on students&rsquo; mother tongue as the medium of instruction even as it sticks to the &lsquo;three language formula&rsquo; but also mandates that no language would be imposed on anyone.The policy indicates that wherever it is possible, the medium of instruction till at least Grade 5, but preferably up till Grade 8 and beyond, will be the mother tongue/local language/ regional language, both public and private schools, are to follow this norm.</li>\r\n	<li><strong><strong>A Single Overarching Body of Higher Education:</strong></strong><br />\r\n	The Higher Education Commission of India (HECI) will now set up a single overarching umbrella body for entire higher education, excluding medical and legal education. The same set of norms for regulation, accreditation, and academic standards, to be applied to both public and private higher education institutions.The Government aims to phase out the affiliation of colleges in 15 years and a stage-wise mechanism is to be established for granting graded autonomy to colleges.</li>\r\n	<li><strong><strong>Separation between subject streams to be blurred:</strong></strong><br />\r\n	As per NEP 2020, the rigid separations between subjects&rsquo; stream will be done away with. Students will have the liberty to choose subjects they would like to study across streams. Vocational education to be introduced in schools from Class 6 and will include internships as well.</li>\r\n	<li><strong><strong>The Return of the FYUP Programme and No More Dropouts:</strong></strong><br />\r\n	The duration of the undergraduate degree will be either 3 or 4 years. Students will also be given multiple exit options within this period. Colleges will have to grant a certificate to a student if they would like to leave after completing 1 year in a discipline or field including vocational and professional areas, a diploma after 2 years of study, or a Bachelor&rsquo;s degree after completing a three-year programme. An Academic Bank of Credit will be established by the Government for digitally storing academic credits earned from different Higher Educational Institutions so that these can be transferred and counted towards the final degree earned.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>National education policy has managed to touch the untouched part of the education system in India. One of the bold propositions of this policy, states that either stand-alone institutions should transform themselves into a multidisciplinary mode or they will have to close. A complete freedom has been granted to state in several domains, under this policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are aware that in reference to education, there has always been a bone of contention between State and Centre over the jurisdiction. The National Education Policy has taken measures to have a holistic outlook in this regard. It is important to note that education is a continuous process, and that is why it is essential to put more emphasis on connecting education to the environment. The recognition of the importance of life skills was long overdue, and the NEP has given more attention to developing life skills in the educational process.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Mindler Takeaways from the NEP 2020:</strong></h3>\r\n\r\n<ol>\r\n	<li>The policy will provide for a lot of flexibility and convenience to the students. This is a crucial step even for the Institutions to place them at par with the International Higher Education Institutions.</li>\r\n	<li>The restructuring of the 10+2 school curriculum, is one of the major highlights of this comprehensive policy, and will make the education system more viable.</li>\r\n	<li>The regional languages have been given the due importance, especially in a country like ours where we are proud of our diversity, this was a step in the right direction.</li>\r\n	<li>Having a single regulatory body will make it more structured and efficient to analyze and monitor the education system.</li>\r\n	<li>The Academic Bank of Credit is a masterstroke, students at the undergraduate level will certainly benefit from this, and the flexibility it brings.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Conclusion</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NEP has addressed the social and gender gap in the education system. The policy has stated that there is an evident gap in the representation of the various social groups in the education system. It has emphasized on the need to overcome the same with regulated interventions. NEP also identified the gender gap in the education system and suggested a mechanism to address it. Quality of teaching is one of the primary agendas of the policy as well. Teachers are integral to the education system, and without improving the way teachers are trained, it will be difficult to improve the quality of education.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>National Education Policy 2020, is an attempt to address most of the grievances of the education system, which have been pending for decades. This is certainly a historic moment for all the stakeholders involved, be it the teachers, students or parents. It is intriguing to see how the norms of this policy will be implemented, but we can be sure that this is a new age for the Indian Education landscape.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Also if you are someone who&rsquo;s planning to revamp their career path, then you can reach out to Mindler, to avail our onlin</p>', NULL, NULL),
(94, 47, 'hi', 'राष्ट्रीय शिक्षा नीति 2020 से संबंधित 5 मुख्य बातें', '<p>&nbsp;</p>\r\n\r\n<p>2020, अनिश्चितता की विशेषता वाला वर्ष। इस रेखा से नीचे वर्षों तक हमें याद रहेगा कि इस साल दुनिया कैसे बदल गई और जीवन एक ठहराव पर आ गया। हमने अब तक की प्रमुख अभूतपूर्व घटनाओं को देखा है, एक के बाद एक प्रमुख और हम अभी भी नहीं किए गए हैं। लेकिन उनमें से एक परिवर्तन जो न केवल अनुमानित था, बल्कि आवश्यक था, भारत में राष्ट्रीय शिक्षा नीति 2020 के रूप में आया, और इस दशक की प्रमुख सकारात्मक सफलताओं में से एक के रूप में होता है अन्यथा दशक की भयानक शुरुआत</p>\r\n\r\n<p>राष्ट्रीय शिक्षा नीति 2020 को सही समय पर पेश किया गया है, जिससे गुणवत्ता संस्थानों, नवाचार की संस्कृति और अत्यधिक कुशल कार्यबल बनाने की प्रक्रिया और दृष्टि को पूरक बनाया जा सके। यह समय था जब हमने भारत में शैक्षिक संस्थानों को बदलने की प्रक्रिया शुरू की, और उन्हें एक निश्चित स्तर प्राप्त करने की क्षमता प्रदान की, कि उनकी तुलना दुनिया के सर्वश्रेष्ठ लोगों की पसंद से की जा सके।</p>\r\n\r\n<p>यह भारत सरकार द्वारा एक ऐतिहासिक बदलाव है, क्योंकि उन्होंने शिक्षा पर 34 वर्षीय राष्ट्रीय नीति को बदल दिया है, जिसे 1986 में नई शिक्षा नीति के साथ 1986 में बनाया गया था। एनईपी, जिसे केंद्रीय मंत्रिमंडल द्वारा अनुमोदित किया गया है , ने भारतीय शिक्षा प्रतिमान में क्रांतिकारी सुधार किए हैं।</p>\r\n\r\n<p>उच्च शिक्षा संस्थानों के लिए एक एकल नियामक बनाना, डिग्री पाठ्यक्रमों में कई प्रवेश और निकास विकल्पों की योजना, कम स्टेक बोर्ड परीक्षा, और विश्वविद्यालयों के लिए सामान्य प्रवेश परीक्षा, ये इस रोमांचक नई नीति से कुछ प्रमुख रास्ते हैं। इन सुधारों में से प्रत्येक इस तथ्य पर प्रतिबिंबित करता है कि भारत एक अर्थव्यवस्था के रूप में कैसे विकसित हुआ है, और कैसे हम एक ताकत के रूप में पहचाने जाने के लिए तैयार हैं। किसी देश की शिक्षा प्रणाली उसकी आर्थिक ताकत का एक सच्चा संकेतक है, और एनईपी 2020 के सुधार, निश्चित रूप से अगले 10 वर्षों में भारत को दुनिया की शीर्ष तीन अर्थव्यवस्थाओं में तोड़ने में मदद करेंगे।</p>\r\n\r\n<h2><strong>राष्ट्रीय शिक्षा नीति 2020 की कुछ प्रमुख विशेषताएं हैं:</strong></h2>\r\n\r\n<ol>\r\n	<li><strong>3 साल की उम्र से शुरू करना:</strong><br />\r\n	संशोधित नीति अनिवार्य स्कूली शिक्षा के आयु वर्ग को 6-14 वर्ष से 3-18 वर्ष तक बढ़ाती है। इस नई प्रणाली में 12 साल की स्कूली शिक्षा के साथ तीन साल की आंगनवाड़ी / प्री-स्कूलिंग शामिल होगी। स्कूल के पाठ्यक्रम की मौजूदा 10 + 2 संरचना को क्रमशः 3-8, 8-11, 11-14 और 14-18 वर्ष की आयु के अनुसार 5 + 3 + 3 + 4 पाठयक्रम संरचना द्वारा प्रतिस्थापित किया जाएगा।</li>\r\n	<li><strong>मातृभाषा को शिक्षा के माध्यम के रूप में संस्थापित किया जाना चाहिए:</strong><br />\r\n	राष्ट्रीय शिक्षा नीति 2020 ने छात्रों की मातृभाषा को शिक्षा के माध्यम के रूप में ध्यान केंद्रित करने का निर्देश दिया है, भले ही यह &#39;तीन भाषा फार्मूले&#39; से जुड़ा हो, लेकिन यह भी अनिवार्य है कि कोई भी भाषा किसी पर भी लागू नहीं होगी। नीति इंगित करती है कि यह जहां भी संभव है, कम से कम ग्रेड 5 तक शिक्षा का माध्यम, लेकिन अधिमानतः ग्रेड 8 और उसके बाद तक, मातृभाषा / स्थानीय भाषा / क्षेत्रीय भाषा होगी, दोनों सार्वजनिक और निजी स्कूल, इस मानदंड का पालन करेंगे।</li>\r\n	<li><strong>उच्च शिक्षा का एक अतिव्यापी शरीर:</strong><br />\r\n	भारतीय उच्चतर शिक्षा आयोग (HECI) अब चिकित्सा और कानूनी शिक्षा को छोड़कर पूरे उच्च शिक्षा के लिए एक एकल अतिव्यापी छतरी निकाय स्थापित करेगा। विनियमन, मान्यता और शैक्षणिक मानकों के लिए मानक का एक ही सेट, सार्वजनिक और निजी दोनों उच्च शिक्षा संस्थानों के लिए लागू किया जाएगा। सरकार का लक्ष्य 15 साल में कॉलेजों की संबद्धता को समाप्त करना है और इसके लिए एक चरण-वार तंत्र स्थापित किया जाना है। महाविद्यालयों को ग्रेडेड स्वायत्तता प्रदान करना।</li>\r\n	<li><strong>धुंधला होने के लिए विषय धाराओं के बीच अलगाव:</strong><br />\r\n	NEP 2020 के अनुसार, विषयों की धारा के बीच का कठोर अलगाव दूर किया जाएगा। छात्रों को उन विषयों को चुनने की स्वतंत्रता होगी, जिन्हें वे धाराओं के बीच अध्ययन करना चाहते हैं। कक्षा 6 से स्कूलों में पेश की जाने वाली व्यावसायिक शिक्षा और इसमें इंटर्नशिप भी शामिल होगी।</li>\r\n	<li><strong>FYUP कार्यक्रम की वापसी और कोई और अधिक गिरावट:</strong><br />\r\n	स्नातक की डिग्री की अवधि 3 या 4 साल होगी। छात्रों को इस अवधि के भीतर कई निकास विकल्प भी दिए जाएंगे। कॉलेजों को एक छात्र को एक प्रमाण पत्र देना होगा, अगर वे व्यावसायिक और व्यावसायिक क्षेत्रों सहित एक अनुशासन या क्षेत्र में 1 वर्ष पूरा करने के बाद छोड़ना चाहते हैं, 2 साल के अध्ययन के बाद डिप्लोमा, या तीन साल का कार्यक्रम पूरा करने के बाद स्नातक की डिग्री। । अलग-अलग उच्च शैक्षणिक संस्थानों से अर्जित अकादमिक क्रेडिटों को डिजिटल रूप से संग्रहीत करने के लिए सरकार द्वारा एक शैक्षणिक बैंक की स्थापना की जाएगी ताकि इन्हें स्थानांतरित किया जा सके और अर्जित अंतिम डिग्री की ओर गिना जा सके।</li>\r\n</ol>\r\n\r\n<p>राष्ट्रीय शिक्षा नीति भारत में शिक्षा प्रणाली के अछूते हिस्से को छूने में कामयाब रही है। इस नीति के साहसिक प्रस्तावों में से एक में कहा गया है कि या तो स्टैंड-अलोन संस्थानों को खुद को एक बहु-विषयक मोड में बदलना चाहिए या उन्हें बंद करना होगा। इस नीति के तहत, कई डोमेन में वर्णन करने की पूर्ण स्वतंत्रता दी गई है।</p>\r\n\r\n<p>हम जानते हैं कि शिक्षा के संदर्भ में, क्षेत्राधिकार को लेकर राज्य और केंद्र के बीच हमेशा विवाद की स्थिति रही है। राष्ट्रीय शिक्षा नीति ने इस संबंध में समग्र दृष्टिकोण रखने के उपाय किए हैं। यह ध्यान रखना महत्वपूर्ण है कि शिक्षा एक सतत प्रक्रिया है, और इसीलिए शिक्षा को पर्यावरण से जोड़ने पर अधिक जोर देना आवश्यक है। जीवन कौशल के महत्व की मान्यता लंबे समय से थी, और एनईपी ने शैक्षिक प्रक्रिया में जीवन कौशल विकसित करने पर अधिक ध्यान दिया है।</p>\r\n\r\n<p><strong>NEP 2020 से माइन्डलर टेकअवे:</strong></p>\r\n\r\n<ol>\r\n	<li>नीति छात्रों को बहुत अधिक लचीलापन और सुविधा प्रदान करेगी। यह संस्थानों के लिए भी एक महत्वपूर्ण कदम है कि उन्हें अंतर्राष्ट्रीय उच्च शिक्षा संस्थानों के बराबर स्थान दिया जाए।</li>\r\n	<li>10 + 2 स्कूल पाठ्यक्रम का पुनर्गठन, इस व्यापक नीति के प्रमुख आकर्षण में से एक है, और यह शिक्षा प्रणाली को अधिक व्यवहार्य बनाएगा।</li>\r\n	<li>क्षेत्रीय भाषाओं को उचित महत्व दिया गया है, खासकर हमारे जैसे देश में जहां हमें अपनी विविधता पर गर्व है, यह सही दिशा में एक कदम था।</li>\r\n	<li>एकल नियामक निकाय होने से शिक्षा प्रणाली का विश्लेषण और निगरानी करने के लिए यह अधिक संरचित और कुशल हो जाएगा।</li>\r\n	<li>अकादमिक बैंक ऑफ क्रेडिट एक मास्टरस्ट्रोक है, स्नातक स्तर पर छात्रों को निश्चित रूप से इससे लाभ होगा, और यह लचीलापन लाता है।</li>\r\n</ol>\r\n\r\n<p><strong>निष्कर्ष</strong><br />\r\nएनईपी ने शिक्षा प्रणाली में सामाजिक और लैंगिक अंतर को संबोधित किया है। नीति में कहा गया है कि शिक्षा प्रणाली में विभिन्न सामाजिक समूहों के प्रतिनिधित्व में स्पष्ट अंतर है। इसने विनियमित हस्तक्षेपों के साथ इसे दूर करने की आवश्यकता पर जोर दिया है। एनईपी ने शिक्षा प्रणाली में लिंग अंतर की भी पहचान की और इसे संबोधित करने के लिए एक तंत्र का सुझाव दिया। शिक्षण की गुणवत्ता नीति के प्राथमिक एजेंडों में से एक है। शिक्षक शिक्षा प्रणाली के अभिन्न अंग हैं, और शिक्षकों के प्रशिक्षित होने के तरीके में सुधार के बिना, शिक्षा की गुणवत्ता में सुधार करना मुश्किल होगा।</p>\r\n\r\n<p>राष्ट्रीय शिक्षा नीति 2020, शिक्षा प्रणाली की अधिकांश शिकायतों को दूर करने का एक प्रयास है, जो दशकों से लंबित है। यह निश्चित रूप से शामिल सभी हितधारकों के लिए एक ऐतिहासिक क्षण है, चाहे वह शिक्षक, छात्र या माता-पिता हों। यह देखना पेचीदा है कि इस नीति के मानदंडों को कैसे लागू किया जाएगा, लेकिन हम यह सुनिश्चित कर सकते हैं कि यह भारतीय शिक्षा परिदृश्य के लिए एक नया युग है।</p>\r\n\r\n<p>इसके अलावा, यदि आप कोई ऐसा व्यक्ति हैं जो अपने कैरियर मार्ग को सुधारने की योजना बना रहा है, तो आप हमारे ऑनलाइन का लाभ उठाने के लिए माइंडलर तक पहुंच सकते हैं</p>', NULL, NULL);
