(13, 7, 'en', 'Terms and conditions', '<h2>Where does it come from?</h2>\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.</p>', NULL, NULL),
(14, 7, 'hi', 'नियम व शर्तें', '<pre>\r\nयह कहां से आता है?\r\nआम धारणा के विपरीत, लोरम इप्सम केवल यादृच्छिक पाठ नहीं है। 45 ईसा पूर्व से शास्त्रीय लैटिन साहित्य के एक टुकड़े में इसकी जड़ें हैं, जो इसे 2000 वर्ष से अधिक पुराना बनाती हैं। वर्जीनिया के हेम्पडेन-सिडनी कॉलेज के एक लैटिन प्रोफेसर रिचर्ड मैकक्लिंटॉक ने लोरम इप्सम मार्ग से अधिक अस्पष्ट लैटिन शब्दों में से एक, कंसेक्टेटुर को देखा, और शास्त्रीय साहित्य में शब्द के हवाले से जाना, निस्संदेह स्रोत की खोज की। लोरेम इप्सम ४० ई.पू. में लिखे गए सिसेरो द्वारा &quot;डे फिनिबस बोनोरम एट मालोरम (द एक्स्ट्रीमस ऑफ गुड एंड एविल) के खंड १.१०.३२ और १.१०.३३ से आता है। यह पुस्तक नैतिकता के सिद्धांत पर एक ग्रंथ है, जो पुनर्जागरण के दौरान बहुत लोकप्रिय है। लोरम इप्सम की पहली पंक्ति, &quot;लोरम इप्सम डोलर अमेट ..&quot;, धारा 1.10.32 में एक पंक्ति से आती है।</pre>', NULL, NULL),
(15, 8, 'en', 'Privacy Policy', '<p>DigiKoach is an emerging test preparation platform where students can register and start preparing for their exams by taking quizzes, tests and practice questions created by brillient minds of IITians and NIT professionals. Digikoach is &nbsp;intending to give you the most updated and enhanced database of questions aiming your success in exams. Question database is not the end of our services, at the same time, we are also offering instant doubt solving feature where you can post your doubts in the form of pictures or texts anytime. You will get the answer of your doubt as low as 15 minutes.</p>', NULL, NULL),
(16, 8, 'hi', 'गोपनीयता नीति', '<pre>\r\nDigiKoach एक उभरता हुआ परीक्षण तैयारी मंच है जहाँ छात्र पंजीकरण कर सकते हैं और IITians और NIT पेशेवरों के शानदार दिमागों द्वारा बनाए गए क्विज़, परीक्षण और अभ्यास के प्रश्न लेकर अपनी परीक्षा की तैयारी शुरू कर सकते हैं। Digikoach आपको परीक्षा में आपकी सफलता का लक्ष्य बनाने वाले प्रश्नों का सबसे अद्यतन और उन्नत डेटाबेस देने का इरादा कर रहा है। प्रश्न डेटाबेस हमारी सेवाओं का अंत नहीं है, साथ ही, हम तत्काल संदेह निवारण सुविधा भी प्रदान कर रहे हैं, जहाँ आप कभी भी चित्रों या ग्रंथों के रूप में अपने संदेह को पोस्ट कर सकते हैं। आपको अपने संदेह का उत्तर 15 मिनट के भीतर मिल जाएगा।</pre>', NULL, NULL),
(17, 9, 'en', 'About us', '<p><strong>Who we are?</strong></p>\r\n\r\n<p>DigiKoach is an emerging test preparation platform where students can register and start preparing for their exams by taking quizzes, tests and practice questions created by brillient minds of IITians and NIT professionals. Digikoach is &nbsp;intending to give you the most updated and enhanced database of questions aiming your success in exams. Question database is not the end of our services, at the same time, we are also offering instant doubt solving feature where you can post your doubts in the form of pictures or texts anytime. You will get the answer of your doubt as low as 15 minutes.</p>', NULL, NULL),
(18, 9, 'hi', 'हमारे बारे में', '<p><strong>हम कौन हैं?</strong></p>\r\n\r\n<p>DigiKoach एक उभरता हुआ परीक्षण तैयारी मंच है जहाँ छात्र पंजीकरण कर सकते हैं और IITians और NIT पेशेवरों के शानदार दिमागों द्वारा बनाए गए क्विज़, परीक्षण और अभ्यास के प्रश्न लेकर अपनी परीक्षा की तैयारी शुरू कर सकते हैं। Digikoach आपको परीक्षा में आपकी सफलता का लक्ष्य बनाने वाले प्रश्नों का सबसे अद्यतन और उन्नत डेटाबेस देने का इरादा कर रहा है। प्रश्न डेटाबेस हमारी सेवाओं का अंत नहीं है, साथ ही, हम तत्काल संदेह निवारण सुविधा भी प्रदान कर रहे हैं, जहाँ आप कभी भी चित्रों या ग्रंथों के रूप में अपने संदेह को पोस्ट कर सकते हैं। आपको अपने संदेह का उत्तर 15 मिनट के भीतर मिल जाएगा।</p>', NULL, NULL);
