INSERT INTO `email_masters` (`email_master_id`, `title`, `email_key`, `parameters`, `subject`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Forget Password', 'forget_password', 'USERNAME,RESET_PASS_OTP', 'DigiKoach  Verification Code', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nYou have recently requested to reset your password please find your OTP below...</p>\r\n\r\n<p>Your OTP: <strong>{{RESET_PASS_OTP}}</strong><br />\r\nIf you have not requested this then please ignore.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam Digikoach</p>', '2020-08-10 18:30:00', '2020-10-07 12:01:12'),
(2, 'Website Contact Form', 'website_contact_form', 'ADMINNAME,MESSAGECONTENT,NAME,EMAIL', 'New Request from Contact Form', '<p><strong>Hi {{ADMINNAME}}</strong>,<br />\r\nYou have received message from&nbsp;<strong>{{NAME}}</strong></p>\r\n\r\n<p>Sender Email Id :&nbsp;<strong>{{EMAIL}}</strong></p>\r\n\r\n<p>Message :&nbsp;<strong>{{MESSAGECONTENT}}</strong></p>\r\n\r\n<p>Thank You,<br />\r\nTeam, Digikoach</p>', '2020-08-10 18:30:00', '2020-10-07 12:03:20'),
(4, 'Student Change Email from Profile', 'student_change_email_otp', 'STUDENT_NAME,VERIFICATION_CODE', 'DigiKoach Email Verification Code', '<p>Hello <strong>{{STUDENT_NAME}},</strong></p>\r\n\r\n<p>You have recently requested to change your email, please find your OTP below</p>\r\n\r\n<p>Your OTP: <strong>{{VERIFICATION_CODE}}</strong><br />\r\nIf you have not requested this then please ignore.</p>\r\n\r\n<p><br />\r\nThank You,<br />\r\nTeam Digikoach</p>', '2020-08-10 18:30:00', '2020-10-06 12:21:10'),
(5, 'Student Deactivated Account', 'student_deactivated_account', 'USERNAME', 'Account Deactivation Request', '<p>Hello <strong>{{USERNAME}},</strong></p>\r\n\r\n<p><br />\r\nYou have recently requested to deactivate your account.<br />\r\nIf you have not requested this then please ignore.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam Digikoach</p>', '2020-08-10 18:30:00', '2020-10-06 12:21:51'),
(6, 'Admin Deactivated Student Account', 'admin_deactivated_student_account', 'USERNAME', 'DigiKoach - Account Deactivated', '<p>Hello <strong>{{USERNAME}},</strong></p>\r\n\r\n<p><br />\r\nYour account has been deactivated by Admin, please contact to admin.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam Digikoach</p>', '2020-08-10 18:30:00', '2020-10-06 12:22:41'),
(7, 'Sub-Admin Set Password', 'sub_admin_set_password', 'USERNAME,PASSWORD', 'You are just one step away', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nYour profile is created please click on the button:<br />\r\n<strong>{{PASSWORD}}&nbsp;</strong>and set your password.<br />\r\nPlease let us if you have any doubts once after you explore the system.<br />\r\nThank You,<br />\r\nTeam Digikoach</p>', '2020-09-02 18:30:00', '2020-10-14 15:59:49'),
(8, 'Admin Announce Live Test Result', 'admin_announce_live_test_result', 'USERNAME,DATE', 'DigiKoach - Your Live Test Result has been Announced', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nYour live test result has been announced, on {{DATE}} please check your result.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam Digikoach</p>', '2020-09-02 18:30:00', '2020-10-07 12:00:37'),
(9, 'Add New Live Test Exam', 'add_new_live_test_exam', 'USERNAME,DATE,CATEGORY', 'DigiKoach - A New Live Test Has Been Added', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nA New live test is added in your level {{CATEGORY}} on Date: {{DATE}} Have a look at the it and participant in the Test.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam Digikoach</p>', '2020-09-23 00:00:00', '2020-10-07 11:58:20'),
(10, 'Add New Quiz Test', 'add_new_quiz_test', 'USERNAME,DATE,CATEGORY', 'A new Quiz has been added', '<p>Hello <strong>{{USERNAME}},</strong></p>\r\n\r\n<p>New Practice Test for <strong>{{CATEGORY}} </strong>Added on <strong>{{DATE}}</strong> Please Check.</p>\r\n\r\n<p>Thank You,<br />\r\nTeam, Digikoach</p>', '2020-09-23 00:00:00', '2020-10-20 11:56:40'),
(11, 'Add New Practice Test', 'add_new_practice_test', 'USERNAME,DATE,CATEGORY', 'Add New Practice Test', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nNew Practice Test for <strong>{{CATEGORY}} </strong>Added on <strong>{{DATE}}</strong> Please Check.<br />\r\nThank You,<br />\r\nTeam, Digikoach</p>', '2020-09-23 00:00:00', '2020-10-07 13:41:19'),
(12, 'Add New Gk Ca Test', 'add_new_gk_ca_test', 'USERNAME,DATE,CATEGORY', 'Add New Gk Ca Test', '<p>Hello <strong>{{USERNAME}},</strong><br />\r\nNew Gk Ca Test for <strong>{{CATEGORY}} </strong>Added on <strong>{{DATE}}</strong> Please Check.<br />\r\nThank You,<br />\r\nTeam, Digikoach</p>', '2020-09-23 00:00:00', '2020-10-07 13:41:19');
