(33, 17, 'en', 'Matching List Type Direction (Q. No. 18) Choices for the correct combination of elements from Column I and Column II are given as options (a), (b), (c) and (d), out of which one is correct. Q.  \'Match the Column I with Column II and mark the correct option from the codes given below.', '(i) → (r), (ii) → (q), (iii) → (p), (iv) → (s)', '2020-10-29 21:19:42', '2020-10-29 21:23:50'),
(34, 17, 'hi', 'मिलान सूची प्रकार डायरेक्शन (Q. No. 18) कॉलम I और कॉलम II से तत्वों के सही संयोजन के लिए विकल्प (ए), (बी), (सी) और (डी) के विकल्प दिए गए हैं, जिनमें से एक सही है। सवाल: \'कॉलम I के कॉलम II से मिलान करें और नीचे दिए गए कोड से सही विकल्प को चिह्नित करें।', '(i) → (r), (ii) → (q), (iii) → (p), (iv) → (s)', '2020-10-29 21:19:42', '2020-10-29 21:23:50'),
(35, 18, 'en', 'Complex compounds are addition compounds formed by the stoichiometric combination of two or more simple salts but do not decompose into constituent ions completely. The first such complex prepared by Tassaert is hexamine cobalt (III) chloride. Later many such compounds were prepared and their properties were studied. The chloramines complexes of cobalt (III) chromium (III) not only exhibit a spectrum of colours but also differ in the reactivity of their chlorides. Moreover, greater the number of ions produced by a complex in solution, greater is the electrical conductivity. This type of information was obtained for several series of complexes.  Question: The number of ions per mole of the complex CoCI3 . 5NH3 in aqueous solution will be', 'Cobalt in +3 state has coordination number = 6 hence the compound is Co(NH3)5Cl.Cl2 and the number of Ions is equal to 2 of chloride and one of the Co(NH3)5Cl...', '2020-10-29 21:21:18', '2020-10-29 21:23:50'),
(36, 18, 'hi', 'जटिल यौगिक दो या अधिक सरल लवणों के स्टोइकोमेट्रिक संयोजन द्वारा गठित अतिरिक्त यौगिक हैं, लेकिन पूरी तरह से घटक आयनों में विघटित नहीं होते हैं। टैसर्ट द्वारा तैयार पहला ऐसा परिसर हेक्सामाइन कोबाल्ट (III) क्लोराइड है। बाद में ऐसे कई यौगिक तैयार किए गए और उनके गुणों का अध्ययन किया गया। कोबाल्ट (III) क्रोमियम (III) के क्लोरैमाइन परिसर न केवल रंगों के एक स्पेक्ट्रम का प्रदर्शन करते हैं, बल्कि उनके क्लोराइड की प्रतिक्रियाशीलता में भी भिन्न होते हैं। इसके अलावा, समाधान में एक जटिल द्वारा उत्पादित आयनों की संख्या अधिक से अधिक होती है, विद्युत चालकता होती है। इस प्रकार की जानकारी परिसरों की कई श्रृंखलाओं के लिए प्राप्त की गई थी।  सवाल: कॉम्प्लेक्स CoCI3 के प्रति तिल की संख्या। जलीय घोल में 5NH3 होगा', '+3 राज्य में कोबाल्ट में समन्वय संख्या = 6 है इसलिए यौगिक सह (NH3) 5Cl.Cl2 है और आयनों की संख्या क्लोराइड के 2 और सह (NH3) 5Cl में से एक के बराबर है ...', '2020-10-29 21:21:18', '2020-10-29 21:23:50'),
(37, 19, 'en', 'Comprehension Type Direction (Q. Nos. 16 and 17) This section contains a paragraph, describing theory, experiments, data, etc. Two questions related to the paragraph have been given. Each question has only one correct answer among the four given options (a), (b), (c) and (d).  Passage Complex compounds are addition compounds formed by the stoichiometric combination of two or more simple salts but do not decompose into constituent ions completely. The first such complex prepared by Tassaert is hexamine cobalt (III) chloride. Later many such compounds were prepared and their properties were studied. The chloramines complexes of cobalt (III) chromium (III) not only exhibit a spectrum of colours but also differ in the reactivity of their chlorides. Moreover, greater the number of ions produced by a complex in solution, greater is the electrical conductivity. This type of information was obtained for several series of complexes.  Question: Coordination number of Co in CoCl3 . 5H2O is six. The volume of 0.1 N AgNO3 needed to precipitate the chlorine in 200 mL of 0.01 M solution of complex is', NULL, '2020-10-29 21:23:50', NULL),
(38, 19, 'hi', 'समझ का प्रकार दिशा (Q. Nos। 16 और 17) इस खंड में एक अनुच्छेद है, जिसमें सिद्धांत, प्रयोग, डेटा आदि का वर्णन किया गया है। अनुच्छेद से संबंधित दो प्रश्न दिए गए हैं। प्रत्येक प्रश्न के चार दिए गए विकल्पों (a), (b), (c) और (d) के बीच केवल एक सही उत्तर है।  मार्ग जटिल यौगिक दो या अधिक सरल लवणों के स्टोइकोमेट्रिक संयोजन द्वारा गठित अतिरिक्त यौगिक हैं, लेकिन पूरी तरह से घटक आयनों में विघटित नहीं होते हैं। टैसर्ट द्वारा तैयार पहला ऐसा परिसर हेक्सामाइन कोबाल्ट (III) क्लोराइड है। बाद में ऐसे कई यौगिक तैयार किए गए और उनके गुणों का अध्ययन किया गया। कोबाल्ट (III) क्रोमियम (III) के क्लोरैमाइन परिसर न केवल रंगों के एक स्पेक्ट्रम का प्रदर्शन करते हैं, बल्कि उनके क्लोराइड की प्रतिक्रियाशीलता में भी भिन्न होते हैं। इसके अलावा, समाधान में एक जटिल द्वारा उत्पादित आयनों की संख्या अधिक से अधिक होती है, विद्युत चालकता होती है। इस प्रकार की जानकारी परिसरों की कई श्रृंखलाओं के लिए प्राप्त की गई थी।  सवाल: CoCl3 में Co की समन्वय संख्या। 5H2O छह है। कॉम्प्लेक्स के 0.01 M समाधान के 200 एमएल में क्लोरीन को उपसर्ग करने के लिए आवश्यक 0.1 N AgNO3 की मात्रा है', NULL, '2020-10-29 21:23:50', NULL),
(39, 20, 'en', 'A freshly prepared aqueous solution of Pd(NH3)2CI2 does not conduct electricity, it suggests that', 'In the aqueous solution of Pd(NH3)2CI2, the atoms of chlorine I are in coordination sphere and the van\'t Hoff factor of the ] compound are unite.', '2020-10-29 21:27:04', '2020-10-29 21:29:21'),
(40, 20, 'hi', 'Pd (NH3) 2CI2 का एक ताजा तैयार जलीय घोल बिजली का संचालन नहीं करता है, यह सुझाव देता है कि', 'Pd (NH3) 2CI2 के जलीय घोल में, क्लोरीन I के परमाणु समन्वय क्षेत्र में हैं और इस परिसर के वैनटॉप हॉफ फैक्टर एकजुट नहीं हैं।', '2020-10-29 21:27:04', '2020-10-29 21:29:21'),
(41, 21, 'en', 'Which of the following statements is/are correct?', '(a) is correct as charge on the complex ion will be +1 (b) is incorrect as the complex will form 4 ions in solution (c) is correct as there is no charge on the complex (d) is also correct as cu+2 has blue colour in solution', '2020-10-29 21:29:21', NULL),
(42, 21, 'hi', 'निम्नलिखित में से कौन सा कथन सही है / हैं?', '(ए) सही है क्योंकि आयन पर जटिल आयन +1 होगा (बी) गलत है क्योंकि जटिल समाधान में 4 आयन बनेंगे (c) सही है क्योंकि कॉम्प्लेक्स पर कोई शुल्क नहीं है (d) सही भी है क्योंकि समाधान में cu + 2 का रंग नीला है', '2020-10-29 21:29:21', NULL),
(47, 24, 'en', 'Oxides are generally formed by the reaction of metals with oxygen at high temperatures. All the metals except scandium form MO oxides which are ionic. The highest oxidation number in the oxides, coincides with the group number and is attained in Sc2O3 to Mn2O7. Beyond 7th group, higher oxides coinciding with the group number do not form. As the oxidation number of metal increases covalent character and acidity increases. Mn2O7, CrO3 are acidic and their lower oxides are basic and amphoteric. Stability of higher oxides increases down the group.  Question: Which of the following undergo disproportionate?', NULL, '2020-10-30 13:00:00', '2020-10-30 13:00:26'),
(48, 24, 'hi', 'ऑक्साइड आमतौर पर उच्च तापमान पर ऑक्सीजन के साथ धातुओं की प्रतिक्रिया से बनते हैं। स्कैंडियम को छोड़कर सभी धातु एमओ ऑक्साइड बनाते हैं जो आयनिक होते हैं। ऑक्साइड में सबसे अधिक ऑक्सीकरण संख्या, समूह संख्या के साथ मेल खाता है और Sc2O3 में Mn2O7 को प्राप्त होता है। 7 वें समूह से परे, समूह संख्या के साथ मेल खाने वाले उच्च ऑक्साइड नहीं बनते हैं। जैसे-जैसे धातु की ऑक्सीकरण संख्या बढ़ जाती है सहसंयोजक चरित्र और अम्लता बढ़ जाती है। Mn2O7, CrO3 अम्लीय हैं और उनके निचले ऑक्साइड बुनियादी और उभयचर हैं। उच्च आक्साइड की स्थिरता से समूह में वृद्धि होती है।  सवाल: निम्नलिखित में से कौन-सा असन्तुलन से गुजरता है?', NULL, '2020-10-30 13:00:00', '2020-10-30 13:00:26'),
(49, 25, 'en', 'Direction (Q. Nos. 16 and 17) This section contains a paragraph, describing theory, experiments, data, etc. Two questions related to the paragraph have been given. Each question has only one correct answer among the four given options (a), (b), (c) and (d). Passage  Oxides are generally formed by the reaction of metals with oxygen at high temperatures. All the metals except scandium form MO oxides which are ionic. The highest oxidation number in the oxides, coincides with the group number and is attained in Sc2O3 to Mn2O7. Beyond 7th group, higher oxides coinciding with the group number do not form. As the oxidation number of metal increases covalent character and acidity increases. Mn2O7, CrO3 are acidic and their lower oxides are basic and amphoteric. Stability of higher oxides increases down the group.  Question: Which of the following reacts with both acids and bases?', 'ZnO and V2O5 are am photeric oxides.', '2020-10-30 13:16:57', '2020-10-30 13:21:04'),
(50, 25, 'hi', 'निर्देशन (Q. Nos। 16 और 17) इस खंड में एक अनुच्छेद है, जिसमें सिद्धांत, प्रयोग, डेटा आदि का वर्णन किया गया है। पैराग्राफ से संबंधित दो प्रश्न दिए गए हैं। प्रत्येक प्रश्न के चार दिए गए विकल्पों (a), (b), (c) और (d) के बीच केवल एक सही उत्तर है। मार्ग  ऑक्साइड आमतौर पर उच्च तापमान पर ऑक्सीजन के साथ धातुओं की प्रतिक्रिया से बनते हैं। स्कैंडियम को छोड़कर सभी धातु एमओ ऑक्साइड बनाते हैं जो आयनिक होते हैं। ऑक्साइड में सबसे अधिक ऑक्सीकरण संख्या, समूह संख्या के साथ मेल खाता है और Sc2O3 में Mn2O7 को प्राप्त होता है। 7 वें समूह से परे, समूह संख्या के साथ मेल खाने वाले उच्च ऑक्साइड नहीं बनते हैं। जैसे-जैसे धातु की ऑक्सीकरण संख्या बढ़ जाती है सहसंयोजक चरित्र और अम्लता बढ़ जाती है। Mn2O7, CrO3 अम्लीय हैं और उनके निचले ऑक्साइड बुनियादी और उभयचर हैं। उच्च आक्साइड की स्थिरता से समूह में वृद्धि होती है।  सवाल: निम्नलिखित में से कौन अम्ल और क्षार दोनों के साथ प्रतिक्रिया करता है?', 'जेडएनओ और वी 2 ओ 5 फोटेरिक ऑक्साइड हैं।', '2020-10-30 13:16:57', '2020-10-30 13:21:04'),
