(73, 37, 'en', 'Direction (Q. No. 19) Choices for the correct combination of elements from Column I and Column II are given as options (a), (b), (c) and (d), out of which one is correct.  Q.  Match the Column I with Column II and mark the correct option from the codes given below.', '(i) Due to ‘S\' at β-position, neighbouring group participation occur giving net retention (twice inversion). (ii) SN2 at α-carbon gives inversion and product is meso diol, (iii) Only SN2 hence inversion (iv) Show neighbouring group effect', '2020-10-31 22:39:10', '2020-10-31 22:42:52'),
(74, 37, 'hi', 'दिशा I (क्यू। 19) कॉलम I और कॉलम II से तत्वों के सही संयोजन के लिए विकल्प (ए), (बी), (सी) और (डी) के विकल्प दिए गए हैं, जिनमें से एक सही है।  प्र कॉलम II के साथ कॉलम I से मिलान करें और नीचे दिए गए कोड से सही विकल्प को चिह्नित करें।', '(i))-S के कारण,-स्थिति में, पड़ोसी समूह की भागीदारी शुद्ध प्रतिधारण (दो बार उलटा) देने के लिए होती है। (ii) α- कार्बन पर SN2 उलटा देता है और उत्पाद मेसो डायोल है, (iii) केवल SN2 इसलिए उलटा (iv) पड़ोसी समूह प्रभाव दिखाएं', '2020-10-31 22:39:10', '2020-10-31 22:42:52'),
(75, 38, 'en', 'Nucleophiles which have more than one type of donor atoms within the same donor group are known as ambident nucleophile e.g. CN- : Both carbon and nitrogen are donor. OCN- : Both oxygen and nitrogen are donor etc. In case of free anionic and ambident nucleophiles, the better donor atom donate its lone pair of electron and forms bond with a-carbon after substitution reaction, in a given period, donor ability decreases from left to right. In a group, donor ability increases from top to bottom. Q.  When iodomethane is treated with sodium isocyanate (NaNCO), CH3NCO is the major product while AgNCO gives CH3CH2OCN as major product because', 'With free NCO-, better donor atom (nitrogen) donate its lone pair. If AgNCO is used, due to covalent character of Ag—N bond lone pair of oxygen is donated giving CH3CH2— OCN as major product.', '2020-10-31 22:42:53', NULL),
(76, 38, 'hi', 'न्यूक्लियोफिल्स जिनके एक ही दाता समूह के भीतर एक से अधिक प्रकार के दाता परमाणु होते हैं, जिन्हें एंबिडेंट न्यूक्लिओफिल के रूप में जाना जाता है। CN-: कार्बन और नाइट्रोजन दोनों दाता हैं। OCN-: ऑक्सीजन और नाइट्रोजन दोनों दाता आदि हैं। नि: शुल्क एनीओनिक और एंबेडिक न्यूक्लियोफाइल के मामले में, बेहतर दाता परमाणु अपने इलेक्ट्रॉन की जोड़ी को दान करता है और प्रतिस्थापन प्रतिक्रिया के बाद कार्बन के साथ बंधन बनाता है, एक निश्चित अवधि में दाता की क्षमता बाएं से दाएं कम हो जाती है। एक समूह में, दाता की क्षमता ऊपर से नीचे तक बढ़ जाती है। प्र जब आयोडोमेथेन को सोडियम आइसोसाइनेट (NaNCO) के साथ व्यवहार किया जाता है, तो CH3NCO प्रमुख उत्पाद है जबकि AgNCO CH3CH2OCN को प्रमुख उत्पाद के रूप में देता है क्योंकि', 'नि: शुल्क एनसीओ- के साथ, बेहतर दाता परमाणु (नाइट्रोजन) अपनी अकेली जोड़ी दान करते हैं। अगर AgNCO का उपयोग किया जाता है, तो Ag-N बॉन्ड लोन की ऑक्सीजन के सहसंयोजक चरित्र के कारण CH3CH2- OCN को प्रमुख उत्पाद के रूप में दान किया जाता है।', '2020-10-31 22:42:53', NULL),
(77, 39, 'en', 'Nucleophiles which have more than one type of donor atoms within the same donor group are known as ambident nucleophile e.g. CN- : Both carbon and nitrogen are donor. OCN- : Both oxygen and nitrogen are donor etc. In case of free anionic and ambident nucleophiles, the better donor atom donate its lone pair of electron and forms bond with a-carbon after substitution reaction, in a given period, donor ability decreases from left to right. In a group, donor ability increases from top to bottom. Q.  Treatment of CH3CH2Br with either NaNO2 or AgNO2 gives the same nitroethane as major product because', 'In both salts, lone pair on nitrogen (better donor atom than oxygen) is free for donation to alkyl halide.', '2020-11-01 19:08:56', '2020-11-01 19:38:54'),
(78, 39, 'hi', 'न्यूक्लियोफिल्स जिनके एक ही दाता समूह के भीतर एक से अधिक प्रकार के दाता परमाणु होते हैं, जिन्हें एंबिडेंट न्यूक्लिओफिल के रूप में जाना जाता है। CN-: कार्बन और नाइट्रोजन दोनों दाता हैं। OCN-: ऑक्सीजन और नाइट्रोजन दोनों दाता आदि हैं। नि: शुल्क एनीओनिक और एंबेडिक न्यूक्लियोफाइल के मामले में, बेहतर दाता परमाणु अपने इलेक्ट्रॉन की जोड़ी को दान करता है और प्रतिस्थापन प्रतिक्रिया के बाद कार्बन के साथ बंधन बनाता है, एक निश्चित अवधि में दाता की क्षमता बाएं से दाएं कम हो जाती है। एक समूह में, दाता की क्षमता ऊपर से नीचे तक बढ़ जाती है। प्र CH3CH2Br का उपचार या तो NaNO2 या AgNO2 के साथ एक ही नाइट्रोएथेन देता है क्योंकि प्रमुख उत्पाद है', 'दोनों लवणों में, नाइट्रोजन पर अकेला जोड़ा (ऑक्सीजन की तुलना में बेहतर दाता परमाणु) एल्काइल हैलाइड के लिए दान के लिए स्वतंत्र है।', '2020-11-01 19:08:56', '2020-11-01 19:38:54'),
(119, 60, 'en', 'From the given information, choose the most appropriate answer:   Q. What will be the net profit?', 'cogs= op.stock +purchase - closing this gives us the closing stock which is 7000 • now gross profit comes to the amt 6000,by making trading ac. or gross profit = sale - cogs ,=6000 • now P/L acc wll have a cr side balance of 6000 nd dr side balance of 4000 hence net profit wll come to *2000*', '2020-11-01 20:33:06', '2020-11-01 20:53:48'),
(120, 60, 'hi', 'दी गई जानकारी से, सबसे उपयुक्त उत्तर चुनें:   Q. शुद्ध लाभ क्या होगा?', 'cogs = op.stock + खरीद - इसे बंद करने से हमें क्लोजिंग स्टॉक मिलता है जो कि 7000 है। अब कुल लाभ 6000 तक आता है, ट्रेडिंग एसी बनाकर। या सकल लाभ = बिक्री - cogs, = 6000 • अब P / L acc wll में 6000 nd ड्राइड की शेष राशि 4000 की शेष राशि है, इसलिए शुद्ध लाभ wll * 2000 * आएगा', '2020-11-01 20:33:06', '2020-11-01 20:53:48'),
(133, 67, 'en', 'A firm purchased goods of Rs. 90,000 and spent Rs. 6,000 on freight towards it. At the end of the year the cost of goods still unsold was Rs. 12,000. Sales during the year Rs. 1,20,000. What is the gross profit earned by the firm?', 'Gross Profit = Sales + closing stock - ( purchases + direct expenses)  = 1,20,000 + 12,000 - ( 90,000 + 6,000) = 1,32,000 - 96,000 = 36,000', '2020-11-01 20:52:05', '2020-11-01 20:53:48'),
(134, 67, 'hi', 'एक फर्म ने रु का सामान खरीदा। 90,000 और रु। माल ढुलाई पर 6,000 रु। वर्ष के अंत में अभी भी बिना बिके माल की लागत रु। थी। 12,000। वर्ष के दौरान बिक्री रु। 1,20,000। फर्म द्वारा अर्जित सकल लाभ क्या है?', 'सकल लाभ = बिक्री + बंद स्टॉक - (खरीद + प्रत्यक्ष व्यय) = 1,20,000 + 12,000 - (90,000 + 6,000) = 1,32,000 - 96,000 = 36,000 रु', '2020-11-01 20:52:05', '2020-11-01 20:53:48'),
(135, 68, 'en', 'A person started a business with capital of Rs. 50,000 and he takes loan from his relative Rs. 5,000. Profit for the year is Rs. 10,000 and drawings Rs. 9,000. What will be the amount of closing capital ?', 'Closing capital=initial capital-drawings + profit =50000-9000+10000 =51000', '2020-11-01 20:53:48', NULL),
(136, 68, 'hi', 'एक व्यक्ति ने रुपये की पूंजी के साथ एक व्यवसाय शुरू किया। 50,000 और वह अपने रिश्तेदार से रु। 5,000। वर्ष के लिए लाभ रु। 10,000 और ड्राइंग रु। 9,000। समापन पूंजी की राशि क्या होगी?', 'बंद पूंजी = प्रारंभिक पूंजी-चित्र + लाभ = 50000-9000 + 10000 = 51000', '2020-11-01 20:53:48', NULL),
