(317, 159, 'en', 'Some chemical elements are required in large amounts by the plants for their proper growth. These inorganic elements are called macronutrients or macroelements. Which of the following elements do not come under the category of macronutrients?', '(c) Both (ii) and (iv)', '2020-11-13 16:45:40', '2020-11-13 17:14:20'),
(318, 159, 'hi', 'पौधों द्वारा उनकी उचित वृद्धि के लिए कुछ रासायनिक तत्वों की बड़ी मात्रा में आवश्यकता होती है। इन अकार्बनिक तत्वों को मैक्रोन्यूट्रिएंट्स या मैक्रोलेमेंट्स कहा जाता है। निम्नलिखित में से कौन सा तत्व मैक्रोन्यूट्रिएंट की श्रेणी में नहीं आता है?', '(ग) दोनों (ii) और (iv)', '2020-11-13 16:45:40', '2020-11-13 17:14:20'),
(319, 160, 'en', 'Manure is organic matter used to enrich the soil with nutrients and also improves the physical structure of soil. Following are given some statements regarding the composition or effects of using manure. Find out the correct sentence about manure.  i. Manure contains large quantities of organic matter and small quantities of nutrients ii. It increases the water holding capacity of sandy soil iii. It helps in draining out the excess of water from clayey soil iv. Its excessive use pollutes the environment because it is made of animal excretory waste', '(a) (i) and (iii)', '2020-11-13 16:50:23', '2020-11-13 17:14:20'),
(320, 160, 'hi', 'खाद जैविक पदार्थ है जिसका उपयोग मिट्टी को पोषक तत्वों से समृद्ध करने के लिए किया जाता है और इससे मिट्टी की भौतिक संरचना में भी सुधार होता है। खाद का उपयोग करने की संरचना या प्रभावों के संबंध में कुछ कथन दिए गए हैं। खाद के बारे में सही वाक्य ज्ञात कीजिए। i। खाद में बड़ी मात्रा में कार्बनिक पदार्थ और छोटी मात्रा में पोषक तत्व होते हैं ii। यह रेतीली मिट्टी की जल धारण क्षमता को बढ़ाता है iii। यह मिट्टी की मिट्टी से पानी की अधिकता को बाहर निकालने में मदद करता है iv। इसका अत्यधिक उपयोग पर्यावरण को प्रदूषित करता है क्योंकि यह जानवरों के मल के अपशिष्ट से बनता है', '(a) (i) and (iii)', '2020-11-13 16:50:23', '2020-11-13 17:14:20'),
