(355, 178, 'en', 'On 1.1.06 Vikas draws a bill of exchange for Rs 10,000 due for payment after 3 months on Ekta. Ekta accepts to this bill of exchange. On 4.3.06, Ekta retires the bill of exchange at a discount of 12% p.a. Which of the discount is correct for premature payment in the books of Ekta?', 'Since it cannot exceed over 100', '2020-11-15 20:53:35', '2020-11-15 20:55:24'),
(356, 178, 'hi', '१.१.०६ पर विकास ने एकता पर ३ महीने के बाद भुगतान के कारण १०,००० रुपये का बिल निकाला। एकता एक्सचेंज के इस बिल को स्वीकार करती है। 4.3.06 पर, एकता ने 12% p.a की छूट पर विनिमय का बिल वापस ले लिया। एकता की पुस्तकों में समय से पहले भुगतान के लिए कौन सी छूट सही है?', 'चूंकि यह 100 से अधिक नहीं हो सकता', '2020-11-15 20:53:35', '2020-11-15 20:55:24'),
(357, 179, 'en', 'Neelam sold goods to Dhiman for Rs 4,000 on 1.5.06. On the same day, he drew on Dhiman a bill for the amount for 3 months, which Dhiman duly accepted. Neelam got the bill discounted with her bank before the due date, Dhiman became insolvent. Later, her estate could pay only 40% of the amount due. What will be the amount of deficiency in the books of Dhiman.', 'Sales to Dhiman = 4000 He paid only 40% of it. 4000×40÷100=1600 Deficiency he had not paid=4000-1600=2400', '2020-11-15 20:56:50', '2020-11-15 21:16:55'),
(358, 179, 'hi', 'नीलम ने 1.5.06 पर धीमान को 4,000 रुपये में सामान बेचा। उसी दिन, उन्होंने धीमान को 3 महीने के लिए राशि का बिल दिया, जिसे धीमान ने विधिवत स्वीकार कर लिया। नीलम को नियत तारीख से पहले अपने बैंक के साथ बिल में छूट मिली, धीमान ढीठ हो गया। बाद में, उसकी संपत्ति देय राशि का केवल 40% भुगतान कर सकती थी। धीमान की किताबों में क्या कमी होगी।', 'धीमान को बिक्री = 4000 उन्होंने इसका केवल 40% भुगतान किया। 4000 × 40 ÷ 100 = 1600 कमी उन्होंने अदा नहीं की थी = 4000-1600 = 2400', '2020-11-15 20:56:50', '2020-11-15 21:16:55'),
(359, 180, 'en', 'A drew a bill on B for Rs 50,000 for 3 months. Proceeds are to be shared equally. A got the bill discounted at 12% p.a. and remits required proceeds to B. The amount of such remittance will be:', '50000*12/100*3/12=15001500/2=75050000-750=24250', '2020-11-15 20:58:05', '2020-11-15 21:16:55'),
(360, 180, 'hi', 'A ने B को 3 महीने के लिए 50,000 रुपये का बिल आकर्षित किया। कार्यवाही समान रूप से साझा की जानी है। A को 12% p.a पर बिल में छूट मिली। और बी को आवश्यक कार्यवाही करता है। ऐसे प्रेषण की राशि निम्नलिखित होगी:', '50000*12/100*3/12=15001500/2=75050000-750=24250', '2020-11-15 20:58:05', '2020-11-15 21:16:55'),
