(368, 184, 'hi', 'X, 30 दिनों के लिए 20,000 रुपये के लिए Y.05 पर एक बिल निकालता है। बिल की परिपक्वता तिथि क्या होगी', '01-01-05 + 30 दिन = 31-01-05 परिपक्वता तिथि में अनुग्रह के 3 दिन शामिल हैं 31-01-05 + 3 दिन = 03-02-05', '2020-11-15 21:04:57', '2020-11-15 21:16:55'),
