(372, 186, 'hi', 'A, B पर 30,000 रुपये का बिल बनाता है। A, B की स्वीकृति और नकदी में शेष की सहायता से 35,000 रु। को 2% छूट पर बंदोबस्त करना चाहता है। B कितना नकद भुगतान करेगा?', 'छूट राशि 35,000 × 2/100 = 700 / - अतिरिक्त राशि = 5,000 देय राशि = 5,000 / - - 700 / - = 4,300 / -', '2020-11-15 21:06:46', '2020-11-15 21:16:55'),
