(376, 188, 'hi', 'एक व्यवसाय की लाभप्रदता और वित्तीय स्थिति जानने के लिए हमने अंत में तैयार किया ।__', 'वित्तीय विवरण, अंतिम खातों को तैयार करने में अंतिम चरण है जो व्यवसाय की लाभप्रदता को जानने के लिए तैयार है और इसे अंत में तैयार किया गया है, इसलिए इसे अंतिम खाते के रूप में कहा जाता है', '2020-11-15 21:10:45', '2020-11-15 21:16:55'),
