(378, 189, 'hi', '____ एक लेखा अवधि के दौरान सकल लाभ और शुद्ध लाभ / हानि का पता लगाने के लिए तैयार।', 'उत्तर डी है क्योंकि लाभ और हानि a / c सकल और शुद्ध लाभ / हानि का पता लगाने के लिए तैयार है जिसका दूसरा नाम आय विवरण है', '2020-11-15 21:12:21', '2020-11-15 21:16:55'),
