(380, 190, 'hi', 'किस आइटम पर प्राप्त छूट पर दिखाई देगा?', 'प्राप्त छूट हमारी आय है और लाभ और हानि खाते के क्रेडिट पक्ष पर पोस्ट की गई सभी आय इसी कारण D सही है।', '2020-11-15 21:13:56', '2020-11-15 21:16:55'),
(381, 191, 'en', 'Computer of a firm should be classified as', 'Computer of a firm is a fixed asset because it is purchased for continued use in the business. And some more examples of fixed assets are land and building, plant and machinery, motor vehicles, furniture etc. Hope this helps and if any other confusion arises,. ask freely.', '2020-11-15 21:15:16', '2020-11-15 21:16:55'),
(382, 191, 'hi', 'एक फर्म के कंप्यूटर को वर्गीकृत किया जाना चाहिए', 'एक फर्म का कंप्यूटर एक निश्चित संपत्ति है क्योंकि इसे व्यवसाय में निरंतर उपयोग के लिए खरीदा जाता है। और अचल संपत्तियों के कुछ और उदाहरण भूमि और भवन, संयंत्र और मशीनरी, मोटर वाहन, फर्नीचर आदि हैं। आशा है कि यह मदद करता है और यदि कोई अन्य भ्रम पैदा होता है। खुलकर पूछें।', '2020-11-15 21:15:16', '2020-11-15 21:16:55'),
