त रूप देने के लिए रखा गया 18 वीं शताब्दी के आश्चर्य की अपनी युवा टिप्पणियों के साथ अपनी मातृभूमि की परंपराएं फ्रांस। \" । । । कहानी का अध्ययन करने वाले विद्वानों के लिए, इसका कथा नाटक केवल कहानीकार ही नहीं रखते हैं अलादीन के लौटने का कारण ढूंढना। यह न केवल फ्रांसीसी और मध्य का इतिहास दर्शाता है पूर्व, लेकिन यह भी [के बारे में एक कहानी] मध्य पूर्वी पेरिस में आने वाले और जो हमारी दुनिया के लिए बोलते हैं आज, \"होर्ता के रूप में यह डालता है। “जिस दिन दीयाब ने गलांड को अलादीन की कहानी सुनाई, दंगे हो गए 1708 से 1709 के सर्दियों और वसंत के दौरान भोजन की कमी के कारण, और दीयाब संवेदनशील था एक तरह से उन लोगों को जो गैलंड नहीं है। जब आप इस डायरी को पढ़ते हैं, तो आप इस एकजुटता को देखते हैं उस समय जो अरब में थे, अरबों में से थे। । । । गैलैंड के लेखन में बहुत कम है यह सुझाव देगा कि वह सहानुभूति के साथ अलादीन जैसे चरित्र को विकसित करने में सक्षम था, लेकिन दीयाब के संस्मरण में एक युवा के विशिष्ट मनोविज्ञान को कैप्चर करने पर एक कथावाचक के बारे में पता चलता है नायक, साथ ही प्रकार के अन्याय और अवसरों को पहचान सकता है जो बदल सकते हैं किसी भी युवा साहसी की राह। \"', '2020-11-16 21:46:07', '2020-11-16 21:54:17'),
(389, 195, 'en', 'Which of the following, if true, would invalidate the inversion that the phrase “flips the script” refers to?', 'In the past, credit for telling the tale of Aladdin has often gone to Antoine Galland . . . the first European translator of . . . Arabian Nights [which] started as a series of translations of an incomplete manuscript of a medieval Arabic story collection. . . But, though those tales were of medieval origin, Aladdin may be a more recent invention. Scholars have not found a manuscript of the story that predates the version published in 1712 by Galland, who wrote in his diary that he first heard the tale from a Syrian storyteller from Aleppo named Hanna Diyab . . . Despite the fantastical elements of the story, scholars now think the main character may actually be based on a real person’s real experiences. . . . Though Galland never credited Diyab in his published translations of the Arabian Nights stories, Diyab wrote something of his own: a travelogue penned in the mid-18th century. In it, he recalls telling Galland the story of Aladdin [and] describes his own hard-knocks upbringing and the way he marveled at the extravagance of Versailles. The descriptions he uses were very similar to the descriptions of the lavish palace that ended up in Galland’s version of the Aladdin story. [Therefore, author Paulo Lemos] Horta believes that “Aladdin might be the young Arab Maronite from Aleppo, marveling at the jewels and riches of Versailles.” . . . For 300 years, scholars thought that the rags-to-riches story of Aladdin might have been inspired by the plots of French fairy tales that came out around the same time, or that the story was invented in that 18th century period as a byproduct of French Orientalism, a fascination with stereotypical exotic Middle Eastern luxuries that was prevalent then. The idea that Diyab might have based it on his own life — the experiences of a Middle Eastern man encountering the French, not vice-versa — flips the script. [According to Horta,] “Diyab was ideally placed to embody the overlapping world of East and West, blending the storytelling traditions of his homeland with his youthful observations of the wonder of 18th-century France.” . . . To the scholars who study the tale, its narrative drama isn’t the only reason storytellers keep finding reason to return to Aladdin. It reflects not only “a history of the French and the Middle East, but also [a story about] Middle Easterners coming to Paris and that speaks to our world today,” as Horta puts it. “The day Diyab told the story of Aladdin to Galland, there were riots due to food shortages during the winter and spring of 1708 to 1709, and Diyab was sensitive to those people in a way that Galland is not. When you read this diary, you see this solidarity among the Arabs who were in Paris at the time. . . . There is little in the writings of Galland that would suggest that he was capable of developing a character like Aladdin with sympathy, but Diyab’s memoir reveals a narrator adept at capturing the distinctive psychology of a young protagonist, as well as recognizing the kinds of injustices and opportunities that can transform the path of any youthful adventurer.”', '2020-11-16 21:49:12', '2020-11-16 21:54:17'),
(390, 195, 'hi', 'निम्नलिखित में से कौन सा, यदि सही है, तो उलटा को अमान्य कर देगा कि वाक्यांश \"स्क्रिप्ट को फ़्लिप करता है\" को संदर्भित करता है?', 'अतीत में, अलादीन की कहानी बताने का श्रेय अक्सर एंटोनी गैलैंड को जाता है। । । सबसे पहला के यूरोपीय अनुवादक। । । अरेबियन नाइट्स [जो] के अनुवाद की एक श्रृंखला के रूप में शुरू हुआ मध्ययुगीन अरबी कहानी संग्रह की अधूरी पांडुलिपि। । । लेकिन, हालांकि वे किस्से थे मध्ययुगीन मूल के, अलादीन एक और हालिया आविष्कार हो सकता है। विद्वानों को नहीं मिला है उस कहानी की पांडुलिपि जो 1712 में गैलैंड द्वारा प्रकाशित संस्करण से पूर्व में लिखी गई थी उनकी डायरी है कि उन्होंने पहली बार अलेप्पो के एक सीरियाई कथाकार से हैना नाम की कहानी सुनी । । । कहानी के काल्पनिक तत्वों के बावजूद, विद्वानों को अब लगता है कि मुख्य चरित्र हो सकता है वास्तव में एक व्यक्ति के वास्तविक अनुभवों पर आधारित होता है। । । । हालांकि गैलैंड को कभी श्रेय नहीं दिया गया दीयाब ने अरब नाइट्स कहानियों के अपने प्रकाशित अनुवादों में, दीयाब ने कुछ लिखा स्वयं: 18 वीं शताब्दी के मध्य में एक यात्रा वृत्तांत। इसमें, वह गैलैंड की कहानी बताते हुए याद करता है अलादीन [और] अपनी खुद की हार्ड-नॉक की परवरिश और जिस तरह से उसने चमत्कार किया, उसका वर्णन करता है वर्साय की असाधारणता। वह जिन विवरणों का उपयोग करता है, वे वर्णन के समान थे भव्य महल जो अलादीन कहानी के गालंद के संस्करण में समाप्त हुआ। [इसलिए, लेखक पाउलो लेमोस] होर्ता का मानना ​​है कि \"अलादीन अलेप्पो से युवा अरब मार्कोनी हो सकता है, वर्साइल के गहने और धन पर चमत्कार । । । 300 वर्षों तक, विद्वानों ने सोचा कि अलादीन की राग-दर-रईस कहानी हो सकती है फ्रांसीसी परी कथाओं के भूखंडों से प्रेरित है जो एक ही समय के आसपास बाहर आए थे, या कि द कहानी का आविष्कार उस 18 वीं शताब्दी की अवधि में फ्रांसीसी ओरिएंटलिज्म, के बायप्रोडक्ट के रूप में किया गया था रूढ़िवादी विदेशी मध्य पूर्वी विलासिता के साथ आकर्षण जो तब प्रचलित था। विचार हो सकता है कि दिव्यांग ने इसे अपने जीवन पर आधारित किया हो - एक मध्य पूर्वी व्यक्ति के अनुभव फ्रेंच का सामना करना पड़ता है, न कि इसके विपरीत - स्क्रिप्ट को फ़्लिप करता है। [होर्टा के अनुसार,] \"दीयाब था आदर्श रूप से पूर्व और पश्चिम की अतिव्यापी दुनिया को मूर्त रूप देने के लिए रखा गया 18 वीं शताब्दी के आश्चर्य की अपनी युवा टिप्पणियों के साथ अपनी मातृभूमि की परंपराएं फ्रांस। \" । । । कहानी का अध्ययन करने वाले विद्वानों के लिए, इसका कथा नाटक केवल कहानीकार ही नहीं रखते हैं अलादीन के लौटने का कारण ढूंढना। यह न केवल फ्रांसीसी और मध्य का इतिहास दर्शाता है पूर्व, लेकिन यह भी [के बारे में एक कहानी] मध्य पूर्वी पेरिस में आने वाले और जो हमारी दुनिया के लिए बोलते हैं आज, \"होर्ता के रूप में यह डालता है। “जिस दिन दीयाब ने गलांड को अलादीन की कहानी सुनाई, दंगे हो गए 1708 से 1709 के सर्दियों और वसंत के दौरान भोजन की कमी के कारण, और दीयाब संवेदनशील था एक तरह से उन लोगों को जो गैलंड नहीं है। जब आप इस डायरी को पढ़ते हैं, तो आप इस एकजुटता को देखते हैं उस समय जो अरब में थे, अरबों में से थे। । । । गैलैंड के लेखन में बहुत कम है यह सुझाव देगा कि वह सहानुभूति के साथ अलादीन जैसे चरित्र को विकसित करने में सक्षम था, लेकिन दीयाब के संस्मरण में एक युवा के विशिष्ट मनोविज्ञान को कैप्चर करने पर एक कथावाचक के बारे में पता चलता है नायक, साथ ही प्रकार के अन्याय और अवसरों को पहचान सकता है जो बदल सकते हैं किसी भी युवा साहसी की राह। \"', '2020-11-16 21:49:12', '2020-11-16 21:54:17'),
