script. [According to Horta,] “Diyab was ideally placed to embody the overlapping world of East and West, blending the storytelling traditions of his homeland with his youthful observations of the wonder of 18th-century France.” . . . To the scholars who study the tale, its narrative drama isn’t the only reason storytellers keep finding reason to return to Aladdin. It reflects not only “a history of the French and the Middle East, but also [a story about] Middle Easterners coming to Paris and that speaks to our world today,” as Horta puts it. “The day Diyab told the story of Aladdin to Galland, there were riots due to food shortages during the winter and spring of 1708 to 1709, and Diyab was sensitive to those people in a way that Galland is not. When you read this diary, you see this solidarity among the Arabs who were in Paris at the time. . . . There is little in the writings of Galland that would suggest that he was capable of developing a character like Aladdin with sympathy, but Diyab’s memoir reveals a narrator adept at capturing the distinctive psychology of a young protagonist, as well as recognizing the kinds of injustices and opportunities that can transform the path of any youthful adventurer.”', '2020-11-16 21:51:55', '2020-11-16 21:54:17'),
(392, 196, 'hi', 'निम्नलिखित में से कौन सा प्राथमिक कारण है कि कहानीकार अब भी अलादीन की कहानी पर मोहित हैं?', 'अतीत में, अलादीन की कहानी बताने का श्रेय अक्सर एंटोनी गैलैंड को जाता है। । । सबसे पहला के यूरोपीय अनुवादक। । । अरेबियन नाइट्स [जो] के अनुवाद की एक श्रृंखला के रूप में शुरू हुआ मध्ययुगीन अरबी कहानी संग्रह की अधूरी पांडुलिपि। । । लेकिन, हालांकि वे किस्से थे मध्ययुगीन मूल के, अलादीन एक और हालिया आविष्कार हो सकता है। विद्वानों को नहीं मिला है उस कहानी की पांडुलिपि जो 1712 में गैलैंड द्वारा प्रकाशित संस्करण से पूर्व में लिखी गई थी उनकी डायरी है कि उन्होंने पहली बार अलेप्पो के एक सीरियाई कथाकार से हैना नाम की कहानी सुनी । । । कहानी के काल्पनिक तत्वों के बावजूद, विद्वानों को अब लगता है कि मुख्य चरित्र हो सकता है वास्तव में एक व्यक्ति के वास्तविक अनुभवों पर आधारित होता है। । । । हालांकि गैलैंड को कभी श्रेय नहीं दिया गया दीयाब ने अरब नाइट्स कहानियों के अपने प्रकाशित अनुवादों में, दीयाब ने कुछ लिखा स्वयं: 18 वीं शताब्दी के मध्य में एक यात्रा वृत्तांत। इसमें, वह गैलैंड की कहानी बताते हुए याद करता है अलादीन [और] अपनी खुद की हार्ड-नॉक की परवरिश और जिस तरह से उसने चमत्कार किया, उसका वर्णन करता है वर्साय की असाधारणता। वह जिन विवरणों का उपयोग करता है, वे वर्णन के समान थे भव्य महल जो अलादीन कहानी के गालंद के संस्करण में समाप्त हुआ। [इसलिए, लेखक पाउलो लेमोस] होर्ता का मानना ​​है कि \"अलादीन अलेप्पो से युवा अरब मार्कोनी हो सकता है, वर्साइल के गहने और धन पर चमत्कार । । । 300 वर्षों तक, विद्वानों ने सोचा कि अलादीन की राग-दर-रईस कहानी हो सकती है फ्रांसीसी परी कथाओं के भूखंडों से प्रेरित है जो एक ही समय के आसपास बाहर आए थे, या कि द कहानी का आविष्कार उस 18 वीं शताब्दी की अवधि में फ्रांसीसी ओरिएंटलिज्म, के बायप्रोडक्ट के रूप में किया गया था रूढ़िवादी विदेशी मध्य पूर्वी विलासिता के साथ आकर्षण जो तब प्रचलित था। विचार हो सकता है कि दिव्यांग ने इसे अपने जीवन पर आधारित किया हो - एक मध्य पूर्वी व्यक्ति के अनुभव फ्रेंच का सामना करना पड़ता है, न कि इसके विपरीत - स्क्रिप्ट को फ़्लिप करता है। [होर्टा के अनुसार,] \"दीयाब था आदर्श रूप से पूर्व और पश्चिम की अतिव्यापी दुनिया को मूर्त रूप देने के लिए रखा गया 18 वीं शताब्दी के आश्चर्य की अपनी युवा टिप्पणियों के साथ अपनी मातृभूमि की परंपराएं फ्रांस। \" । । । कहानी का अध्ययन करने वाले विद्वानों के लिए, इसका कथा नाटक केवल कहानीकार ही नहीं रखते हैं अलादीन के लौटने का कारण ढूंढना। यह न केवल फ्रांसीसी और मध्य का इतिहास दर्शाता है पूर्व, लेकिन यह भी [के बारे में एक कहानी] मध्य पूर्वी पेरिस में आने वाले और जो हमारी दुनिया के लिए बोलते हैं आज, \"होर्ता के रूप में यह डालता है। “जिस दिन दीयाब ने गलांड को अलादीन की कहानी सुनाई, दंगे हो गए 1708 से 1709 के सर्दियों और वसंत के दौरान भोजन की कमी के कारण, और दीयाब संवेदनशील था एक तरह से उन लोगों को जो गैलंड नहीं है। जब आप इस डायरी को पढ़ते हैं, तो आप इस एकजुटता को देखते हैं उस समय जो अरब में थे, अरबों में से थे। । । । गैलैंड के लेखन में बहुत कम है यह सुझाव देगा कि वह सहानुभूति के साथ अलादीन जैसे चरित्र को विकसित करने में सक्षम था, लेकिन दीयाब के संस्मरण में एक युवा के विशिष्ट मनोविज्ञान को कैप्चर करने पर एक कथावाचक के बारे में पता चलता है नायक, साथ ही प्रकार के अन्याय और अवसरों को पहचान सकता है जो बदल सकते हैं किसी भी युवा साहसी की राह। \"', '2020-11-16 21:51:55', '2020-11-16 21:54:17'),
(393, 197, 'en', 'Which of the following does not contribute to the passage’s claim about the authorship of Aladdin?', 'Contemporary internet shopping conjures a perfect storm of choice anxiety. Research has consistently held that people who are presented with a few options make better, easier decisions than those presented with many. . . . Helping consumers figure out what to buy amid an endless sea of choice online has become a cottage industry unto itself. Many brands and retailers now wield marketing buzzwords such as curation, differentiation, and discovery as they attempt to sell an assortment of stuff targeted to their ideal customer. Companies find such shoppers through the data gold mine of digital advertising, which can catalog people by gender, income level, personal interests, and more. Since Americans have lost the ability to sort through the sheer volume of the consumer choices available to them, a ghost now has to be in the retail machine, whether it’s an algorithm, an influencer, or some snazzy ad tech to help a product follow you around the internet. Indeed, choice fatigue is one reason so many people gravitate toward lifestyle influencers on Instagram—the relentlessly chic young moms and perpetually vacationing 20-somethings—who present an aspirational worldview, and then recommend the products and services that help achieve it. . . . For a relatively new class of consumer-products start-ups, there’s another method entirely. Instead of making sense of a sea of existing stuff, these companies claim to disrupt stuff as Americans know it. Casper (mattresses), Glossier (makeup), Away (suitcases), and many others have sprouted up to offer consumers freedom from choice: The companies have a few aesthetically pleasing and supposedly highly functional options, usually at mid-range prices. They’re selling nice things, but maybe more importantly, they’re selling a confidence in those things, and an ability to opt out of the stuff rat race. . . . One-thousand-dollar mattresses and $300 suitcases might solve choice anxiety for a certain tier of consumer, but the companies that sell them, along with those that attempt to massage the larger stuff economy into something navigable, are still just working within a consumer market that’s broken in systemic ways. The presence of so much stuff in America might be more valuable if it were more evenly distributed, but stuff’s creators tend to focus their energy on those who already have plenty. As options have expanded for people with disposable income, the opportunity to buy even basic things such as fresh food or quality diapers has contracted for much of America’s lower classes. For start-ups that promise accessible simplicity, their very structure still might eventually push them toward overwhelming variety. Most of these companies are based on hundreds of millions of dollars of venture capital, the investors of which tend to expect a steep growth rate that can’t be achieved by selling one great mattress or one great sneaker. Casper has expanded into bedroom furniture and bed linens. Glossier, after years of marketing itself as no-makeup makeup that requires little skill to apply, recently launched a full line of glittering color cosmetics. There may be no way to opt out of stuff by buying into the right thing.', '2020-11-16 21:54:11', '2020-11-16 21:54:17'),
(394, 197, 'hi', 'निम्नलिखित में से कौन अलादीन की लेखक के बारे में पारित होने के दावे में योगदान नहीं करता है?', 'समकालीन इंटरनेट शॉपिंग पसंद की चिंता का एक आदर्श तूफान है। अनुसंधान ने लगातार माना है कि जिन लोगों को कुछ विकल्पों के साथ प्रस्तुत किया जाता है वे कई लोगों के साथ प्रस्तुत किए गए की तुलना में बेहतर, आसान निर्णय लेते हैं। । । । उपभोक्ताओं को यह जानने में मदद करना कि क्या खरीदना है ऑनलाइन पसंद के अंतहीन समुद्र के बीच खुद के लिए एक कुटीर उद्योग बन गया है। कई ब्रांड और खुदरा विक्रेताओं ने अब विपणन buzzwords जैसे कि अवधि, भेदभाव और खोज को मिटा दिया है के रूप में वे अपने आदर्श ग्राहक को लक्षित सामान का एक वर्गीकरण बेचने का प्रयास करते हैं। कंपनियां ढूंढती हैं डिजिटल विज्ञापन की डेटा गोल्ड माइन के माध्यम से ऐसे खरीदार, जो लोगों को सूचीबद्ध कर सकते हैं लिंग, आय स्तर, व्यक्तिगत हित, और बहुत कुछ। चूंकि अमेरिकियों ने क्षमता खो दी है उनके लिए उपलब्ध उपभोक्ता विकल्पों की सरासर मात्रा के माध्यम से सॉर्ट करें, अब एक भूत है रिटेल मशीन में हो, चाहे वह एक एल्गोरिथ्म हो, एक प्रभावक हो, या कुछ स्नेज़ी विज्ञापन तकनीक हो एक उत्पाद की मदद से आप इंटरनेट के आसपास का पालन करें। दरअसल, पसंद की थकान एक कारण है लोग इंस्टाग्राम पर जीवनशैली से जुड़े लोगों की ओर रुख करते हैं - अथक ठाठ वाले युवा लम्हों की और 20-somethings - जो एक महाप्राण विश्वदृष्टि पेश करते हैं, और फिर स्थायी रूप से छुट्टी उन उत्पादों और सेवाओं की सिफारिश करें जो इसे प्राप्त करने में मदद करती हैं। । । । उपभोक्ता-उत्पादों के स्टार्ट-अप के अपेक्षाकृत नए वर्ग के लिए, पूरी तरह से एक और तरीका है। मौजूदा सामानों के समुद्र की भावना बनाने के बजाय, ये कंपनियां सामान को बाधित करने का दावा करती हैं अमेरिकी इसे जानते हैं। कैस्पर (गद्दे), ग्लोसियर (मेकअप), दूर (सूटकेस), और कई दूसरों ने उपभोक्ताओं को पसंद से मुक्ति देने के लिए अंकुरित किया है: कंपनियों के पास कुछ है सौंदर्यवादी रूप से मनभावन और माना जाता है कि अत्यधिक कार्यात्मक विकल्प, आमतौर पर मध्य-श्रेणी की कीमतों पर। वे अच्छी चीजें बेच रहे हैं, लेकिन शायद अधिक महत्वपूर्ण बात, वे उन में एक विश्वास बेच रहे हैं सामान, और चूहे की दौड़ से बाहर निकलने की क्षमता। । । । एक हजार डॉलर के गद्दे और $ 300 सूटकेस एक निश्चित के लिए पसंद की चिंता को हल कर सकते हैं उपभोक्ता के साथ, लेकिन जो कंपनियां उन्हें बेचती हैं, उनके साथ जो मालिश करने का प्रयास करते हैं कुछ नौगम्य में बड़े सामान अर्थव्यवस्था, अभी भी एक उपभोक्ता के भीतर काम कर रहे हैं बाजार जो प्रणालीगत तरीकों से टूट गया है। अमेरिका में इतने सामान की मौजूदगी हो सकती है यदि यह समान रूप से वितरित किया गया था, तो अधिक मूल्यवान है, लेकिन सामान के निर्माता अपनी ऊर्जा को केंद्रित करते हैं उन लोगों पर जो पहले से ही बहुत सारे हैं। चूंकि डिस्पोजेबल वाले लोगों के लिए विकल्पों का विस्तार हुआ है आय, ताजा भोजन या गुणवत्ता वाले डायपर जैसी बुनियादी चीजों को खरीदने का अवसर अमेरिका के अधिकांश निम्न वर्गों के लिए अनुबंधित सुलभ सादगी का वादा करने वाले स्टार्ट-अप के लिए, उनकी संरचना अभी भी अंततः धक्का दे सकती है उन्हें भारी विविधता की ओर। इनमें से ज्यादातर कंपनियां सैकड़ों पर आधारित हैं उद्यम पूंजी के लाखों डॉलर, जिनमें से निवेशक एक स्थिर विकास दर की उम्मीद करते हैं वह एक महान गद्दा या एक महान स्नीकर बेचकर हासिल नहीं किया जा सकता है। कैस्पर है बेडरूम फर्नीचर और बेड लिनेन में विस्तारित। खुद के रूप में विपणन के वर्षों के बाद, Glossier नो-मेकअप मेकअप जिसे लागू करने के लिए बहुत कम कौशल की आवश्यकता होती है, हाल ही में चमकने की एक पूरी लाइन शुरू की गई रंग सौंदर्य प्रसाधन। सही चीज़ में खरीद कर सामान बाहर निकालने का कोई तरीका नहीं हो सकता है।', '2020-11-16 21:54:11', '2020-11-16 21:54:17'),
