(627, 314, 'en', 'The total revenue in ₹ received from the sale of x units of an article is given by R(x) = 3x² + 36x + 5. The marginal revenue when x = 15 is (in ₹ )', '(a), as R\'(x) = 6x + 36 ⇒ R\'(15) = 90 + 36 = 126', '2021-01-10 20:34:35', '2021-01-10 20:37:15'),
(628, 314, 'hi', 'एक लेख की x इकाइयों की बिक्री से प्राप्त total में कुल राजस्व R (x) = 3x² + 36x + 5. द्वारा दिया गया है, जब x = 15 (₹ में) मामूली राजस्व', '(a), as R\'(x) = 6x + 36 ⇒ R\'(15) = 90 + 36 = 126', '2021-01-10 20:34:35', '2021-01-10 20:37:15'),
(629, 315, 'en', 'The side of an equilateral triangle is increasing at the rate of 2 cm/s. The rate at which area increases when the side is 10 is', NULL, '2021-01-10 20:37:15', NULL),
(630, 315, 'hi', 'एक समबाहु त्रिभुज की भुजा 2 सेमी / सेकंड की दर से बढ़ रही है। जब पक्ष 10 होता है तो किस क्षेत्र में दर बढ़ जाती है', NULL, '2021-01-10 20:37:15', NULL),
(631, 316, 'en', 'The point on the curve where tangent to the curve y2 = x, makes an angle of 45° clockwise with the x-axis is', NULL, '2021-01-10 20:45:25', '2021-01-10 21:03:22'),
(632, 316, 'hi', 'वक्र पर बिंदु जहां वक्र y2 = x के लिए स्पर्शरेखा है, x- अक्ष के साथ 45 ° दक्षिणावर्त का कोण बनाता है', NULL, '2021-01-10 20:45:25', '2021-01-10 21:03:22'),
(633, 317, 'en', 'The line y = x + 1 is a tangent to the curve y2 = 4x at the point', '(b), as slope of line y = x + 1 is 1 and dydx = 2y = 1 ⇒ y = 2 and x = 1. Therefore point is (1, 2).', '2021-01-10 20:47:44', '2021-01-10 21:03:22'),
(634, 317, 'hi', 'लाइन y = x + 1 बिंदु पर वक्र y2 = 4x की एक स्पर्शरेखा है', '(b), as slope of line y = x + 1 is 1 and dydx = 2y = 1 ⇒ y = 2 and x = 1. Therefore point is (1, 2).', '2021-01-10 20:47:44', '2021-01-10 21:03:22'),
(635, 318, 'en', NULL, NULL, '2021-01-10 20:51:49', '2021-01-10 21:03:22'),
