(637, 319, 'en', 'The political and constitutional changes brought about by the French Revolution were:', 'France, was a full-fledged territorial state in 1789 under the rule of an absolute monarch. The political and constitutional changes that came in the wake of the French Revolution led to the transfer of sovereignty from the monarchy to a body of French citizens. The revolution proclaimed that it was the people who would henceforth constitute the nation and shape its destiny.', '2021-01-10 20:53:33', '2021-01-10 21:12:37'),
(638, 319, 'hi', 'फ्रांसीसी क्रांति द्वारा राजनीतिक और संवैधानिक परिवर्तन लाए गए:', 'फ्रांस, एक पूर्ण सम्राट के शासन के तहत 1789 में एक पूर्ण क्षेत्रीय राज्य था। फ्रांसीसी क्रांति के मद्देनजर आए राजनीतिक और संवैधानिक परिवर्तनों ने राजशाही से फ्रांसीसी नागरिकों के एक निकाय को संप्रभुता का हस्तांतरण किया। क्रांति ने घोषणा की कि यह ऐसे लोग थे जो राष्ट्र का गठन करेंगे और अपने भाग्य को आकार देंगे।', '2021-01-10 20:53:33', '2021-01-10 21:12:37'),
(639, 320, 'en', 'Let x, ye R, then the determinant', NULL, '2021-01-10 20:58:40', '2021-01-10 21:03:22'),
(640, 320, 'hi', 'आज्ञा देना x, तु आर, तो निर्धारक', NULL, '2021-01-10 20:58:40', '2021-01-10 21:03:22'),
(641, 321, 'en', 'Which European country colonized Vietnam?', 'FRENCH tried to colonize VIETNAM because :- (1) Colonies were considered essential for the supply of raw materials and other essential goods to the mother land. (2) Like other western countries, France also thought that it was the duty of the advanced countries to bring in the benefit of civilisation to backward countries.(3) So, French decided to developed the infrastructure and education system of Vietnam. In turn, Vietnam had to serve the interests of France like raw materials. (4) Vietnam as a colony for France would extend its global market. (5) Extension of global markets would ensure a greater profit for the French government.', '2021-01-10 20:59:21', '2021-01-10 21:12:37'),
(642, 321, 'hi', 'किस यूरोपीय देश ने वियतनाम का उपनिवेश किया?', 'FRENCH ने VIETNAM को उपनिवेश बनाने की कोशिश की क्योंकि: - (1) उपनिवेशों को मातृ भूमि के लिए कच्चे माल और अन्य आवश्यक वस्तुओं की आपूर्ति के लिए आवश्यक माना जाता था। (२) अन्य पश्चिमी देशों की तरह, फ्रांस ने भी सोचा था कि पिछड़े देशों की सभ्यता के लाभ के लिए उन्नत देशों का कर्तव्य है। बदले में, वियतनाम को कच्चे माल की तरह फ्रांस के हितों की सेवा करनी थी। (4) फ्रांस के लिए एक उपनिवेश के रूप में वियतनाम अपने वैश्विक बाजार का विस्तार करेगा। (5) वैश्विक बाजारों का विस्तार फ्रांसीसी सरकार के लिए अधिक लाभ सुनिश्चित करेगा।', '2021-01-10 20:59:21', '2021-01-10 21:12:37'),
(643, 322, 'en', 'Name the Italian revolutionary from Genoa.', 'Giuseppe Mazzini, (born June 22, 1805, Genoa—died March 10, 1872, Pisa, Italy), Genoese propagandist and revolutionary, founder of the secret revolutionary society Young Italy (1832), and a champion of the movement for Italian unity known as the Risorgimento. An uncompromising republican, he refused to participate in the parliamentary government that was established under the monarchy of the House of Savoy when Italy became unified and independent (1861).', '2021-01-10 21:03:15', '2021-01-10 21:12:37'),
(644, 322, 'hi', 'जेनोआ से इतालवी क्रांतिकारी का नाम बताइए।', 'Giuseppe Mazzini, (जन्म 22 जून, 1805, जेनोआ- 10 मार्च, 1872, पीसा, इटली), जिओनी प्रचारक और क्रांतिकारी, गुप्त क्रांतिकारी समाज के संस्थापक युवा इटली (1832), और इतालवी एकता के लिए आंदोलन के एक चैंपियन के रूप में जाना जाता है। Risorgimento के रूप में। एक असंबद्ध गणतंत्र, उन्होंने संसदीय सरकार में भाग लेने से इंकार कर दिया जो इटली के एकीकृत होने और स्वतंत्र होने (1861) के दौरान हाउस ऑफ सेवॉय की राजशाही के तहत स्थापित की गई थी।', '2021-01-10 21:03:15', '2021-01-10 21:12:37'),
(645, 323, 'en', NULL, '(d), as value of determinant is sum of the product of elements of any row and column and then- respective cofactor.', '2021-01-10 21:03:23', NULL),
(646, 323, 'hi', NULL, '(डी), निर्धारक के मूल्य के रूप में किसी भी पंक्ति और स्तंभ के तत्वों के उत्पाद का योग है और फिर संबंधित कोफ़ेक्टर', '2021-01-10 21:03:23', NULL),
(647, 324, 'en', 'When did Napoleon invade Italy?', 'In Italy, Napoleon Bonaparte\'s armies were laying siege to Mantua at the beginning of the year 1797, and a second attempt by Austrians under Joseph Alvinczy to raise the siege was driven off at the Battle of Rivoli.', '2021-01-10 21:06:32', '2021-01-10 21:12:37'),
(648, 324, 'hi', 'नेपोलियन ने इटली पर कब आक्रमण किया?', 'इटली में, नेपोलियन बोनापार्ट की सेनाएं वर्ष 1797 की शुरुआत में मंटुआ की घेराबंदी कर रही थीं, और जोसेफ अल्विंकज़ी के नेतृत्व में ऑस्ट्रियाई लोगों द्वारा घेराबंदी को बढ़ाने के लिए दूसरा प्रयास रिवोली की लड़ाई में किया गया था।', '2021-01-10 21:06:32', '2021-01-10 21:12:37'),
(649, 325, 'en', 'Women were admitted in the Frankfurt parliament convened in the Church of St Paul, but only as:', '{D} Despite their full participation..........they were not granted suffrage rights........... and only seen as observers......', '2021-01-10 21:12:05', '2021-01-10 21:12:37'),
(650, 325, 'hi', 'सेंट पॉल चर्च में बुलाई गई फ्रैंकफर्ट पार्लियामेंट में महिलाओं को प्रवेश दिया गया, लेकिन केवल:', '{D} अपनी पूर्ण भागीदारी के बावजूद .......... उन्हें मताधिकार का अधिकार नहीं दिया गया ........... और केवल पर्यवेक्षकों के रूप में देखा गया ......', '2021-01-10 21:12:05', '2021-01-10 21:12:37'),
(651, 326, 'en', 'A merchant travelling from Hamburg to Nuremberg, in the first half of the nineteenth century, had to pass through how many customs barriers to sell his goods?', 'The merchant has to pass through 11 custom barriers to sell his goods and pay about 5 percent of customs duty at each one of them.', '2021-01-10 21:16:26', NULL),
(652, 326, 'hi', 'उन्नीसवीं शताब्दी के पूर्वार्ध में हैम्बर्ग से नूर्नबर्ग की यात्रा करने वाले एक व्यापारी को अपना माल बेचने के लिए कितने सीमा शुल्क बाधाओं से गुजरना पड़ा?', 'व्यापारी को अपना माल बेचने के लिए 11 कस्टम बाधाओं से गुजरना पड़ता है और उनमें से प्रत्येक पर सीमा शुल्क का 5 प्रतिशत भुगतान करना पड़ता है।', '2021-01-10 21:16:26', NULL),
