(655, 328, 'en', 'A merchant travelling from Hamburg to Nuremberg, in the first half of the nineteenth century, had to pass through how many customs barriers to sell his goods?', 'The merchant has to pass through 11 custom barriers to sell his goods and pay about 5 percent of customs duty at each one of them.', '2021-01-10 21:22:01', '2021-01-10 21:48:29'),
(656, 328, 'hi', 'उन्नीसवीं शताब्दी के पूर्वार्ध में हैम्बर्ग से नूर्नबर्ग की यात्रा करने वाले एक व्यापारी को अपना माल बेचने के लिए कितने सीमा शुल्क बाधाओं से गुजरना पड़ा?', 'व्यापारी को अपना माल बेचने के लिए 11 कस्टम बाधाओं से गुजरना पड़ता है और उनमें से प्रत्येक पर सीमा शुल्क का 5 प्रतिशत भुगतान करना पड़ता है।', '2021-01-10 21:22:01', '2021-01-10 21:48:29'),
