(659, 330, 'en', 'What did weavers in Silesia, in 1845, revolt against?', 'The purpose of the ‘Silesian Weavers’ revolution was due to the dishonesty of the weavers by the constructors. In 1845, the weavers fostered a revolution upon the entrepreneurs as the contractors drastically decreased their payments.', '2021-01-10 21:26:16', '2021-01-10 21:48:29'),
(660, 330, 'hi', '1845 में सिलेसिया में बुनकरों ने क्या विद्रोह किया था?', 'Ian सिलेसियन वीवर्स की क्रांति का उद्देश्य निर्माणकर्ताओं द्वारा बुनकरों की बेईमानी के कारण था। 1845 में, बुनकरों ने उद्यमियों पर एक क्रांति ला दी क्योंकि ठेकेदारों ने अपने भुगतान में भारी कमी की।', '2021-01-10 21:26:16', '2021-01-10 21:48:29'),
(661, 331, 'en', NULL, NULL, '2021-01-10 21:26:47', '2021-01-10 21:26:53'),
(662, 331, 'hi', NULL, NULL, '2021-01-10 21:26:47', '2021-01-10 21:26:53'),
(663, 332, 'en', 'Who was proclaimed the King of United Italy, in 1861?', 'The Kingdom of Italy was a state which existed from 1861—when King Victor Emmanuel II of Sardinia was proclaimed King of Italy—until 1946—when a constitutional referendum led civil discontent to abandon the monarchy and form the modern Italian Republic.', '2021-01-10 21:31:36', '2021-01-10 21:48:29'),
(664, 332, 'hi', '1861 में संयुक्त इटली का राजा किसे घोषित किया गया था?', 'इटली राज्य एक राज्य था जो 1861 से अस्तित्व में था - जब सार्डिनिया के राजा विक्टर इमैनुअल II को 1946 तक इटली का राजा घोषित किया गया था - जब एक संवैधानिक जनमत संग्रह ने राजतंत्र को त्यागने और आधुनिक इतालवी गणराज्य बनाने के लिए नागरिक असंतोष का नेतृत्व किया था।', '2021-01-10 21:31:36', '2021-01-10 21:48:29'),
(665, 333, 'en', 'What led to the abolishing of the tariff barriers in the German-speaking regions of Europe and the reduction of currencies?', 'During the early nineteenth century, Europe were closely allied to the ideology of liberalism. In reference to economy this liberalism denotes freedom of market, less restrictions of state on the movement of goods and capitals. To get rid of these economic problems that was the main demand of the new emerged middle class. Existence of countless small principalities, different currencies, number of customs barriers created obstacles to economic exchange and growth for the new commercial classes. To sort out that problem Prussia including with most of the German states formed a customs union or Zollverein in 1834.', '2021-01-10 21:35:18', '2021-01-10 21:48:29'),
(666, 333, 'hi', 'यूरोप के जर्मन-भाषी क्षेत्रों में टैरिफ बाधाओं को समाप्त करने और मुद्राओं की कमी के कारण क्या हुआ?', 'उन्नीसवीं शताब्दी की शुरुआत के दौरान, यूरोप उदारवाद की विचारधारा से निकटता से जुड़ा हुआ था। अर्थव्यवस्था के संदर्भ में यह उदारवाद बाजार की स्वतंत्रता को दर्शाता है, माल और राजधानियों के आंदोलन पर राज्य के कम प्रतिबंध। इन आर्थिक समस्याओं से छुटकारा पाने के लिए जो नए उभरे मध्यवर्ग की मुख्य माँग थी। अनगिनत छोटी रियासतों, विभिन्न मुद्राओं, सीमा शुल्क बाधाओं की संख्या ने नए वाणिज्यिक वर्गों के लिए आर्थिक विनिमय और विकास में बाधाएं पैदा कीं। उस समस्या को हल करने के लिए प्रशिया ने अधिकांश जर्मन राज्यों के साथ मिलकर 1834 में एक सीमा शुल्क संघ या ज़ोल्वरिन का गठन किया।', '2021-01-10 21:35:18', '2021-01-10 21:48:29'),
(667, 334, 'en', 'In revolutionary France, who were granted exclusive rights to vote?', '1. Equality before the law did not necessarily stand for universal suffrage. 2. In revolutionary France, which marked the first political experiment in liberal democracy, the right to vote and to get elected was granted exclusively to property-owning men. 3. Men without property and all women were excluded from political rights. Only for a brief period under the Jacobins did all adult males enjoy suffrage. 4. However, the Napoleonic Code went back to limited suffrage and reduced women to the status of a minor, subject to the authority of fathers and husbands.', '2021-01-10 21:42:03', '2021-01-10 21:48:29'),
(668, 334, 'hi', 'क्रांतिकारी फ्रांस में, जिन्हें वोट देने के लिए विशेष अधिकार दिए गए थे?', '1. कानून के सामने समानता अनिवार्य रूप से सार्वभौमिक मताधिकार के लिए नहीं खड़ी थी। 2. क्रांतिकारी फ्रांस में, जिसने उदार लोकतंत्र में पहले राजनीतिक प्रयोग को चिह्नित किया, वोट देने और निर्वाचित होने का अधिकार विशेष रूप से संपत्ति के मालिक पुरुषों को दिया गया था। 3. बिना संपत्ति वाले पुरुषों और सभी महिलाओं को राजनीतिक अधिकारों से बाहर रखा गया था। केवल एक संक्षिप्त अवधि के लिए जैकोबिन्स ने सभी वयस्क पुरुषों को मताधिकार का आनंद दिया। 4. हालांकि, नेपोलियन कोड सीमित मताधिकार के लिए वापस चला गया और महिलाओं को एक नाबालिग की स्थिति तक कम कर दिया, जो पिता और पति के अधिकार के अधीन था।', '2021-01-10 21:42:03', '2021-01-10 21:48:29'),
(669, 335, 'en', 'which of the following statements is true?', 'Debenture holder are not a real owner of company and the interest paid to them is charge on profit and they cannot get their money only at the time of winding up', '2021-01-10 21:45:55', '2021-01-10 21:47:25'),
(670, 335, 'hi', 'which of the following statements is true?', 'Debenture holder are not a real owner of company and the interest paid to them is charge on profit and they cannot get their money only at the time of winding up', '2021-01-10 21:45:55', '2021-01-10 21:47:25'),
(671, 336, 'en', 'When were the \'Conservatives Regimes\' set up?', 'In 1815, representatives of the conservative European powers were Britain, Russia, Prussia and Austria . Conservatism as a political ideology arose after the defeat of Napoleon in 1815 at the Battle of Waterloo. The conservative regimes : - Were autocratic - Were intolerant to criticism and dissent - Adopted the censorship of press for curbing the liberal ideals - Discouraged any questions that challenged their legitimacy The contribution of Conservatism stands for the preservation of the traditional institutions of state and society such as the monarchy, the church, social hierarchies and family along with the modern changes introduced by Napoleon.', '2021-01-10 21:46:11', '2021-01-10 21:48:29'),
(672, 336, 'hi', '\'रूढ़िवादी शासन\' कब स्थापित किए गए थे?', '1815 में, रूढ़िवादी यूरोपीय शक्तियों के प्रतिनिधि ब्रिटेन, रूस, प्रशिया और ऑस्ट्रिया थे। वाटरलू के युद्ध में 1815 में नेपोलियन की हार के बाद एक राजनीतिक विचारधारा के रूप में रूढ़िवाद पैदा हुआ। रूढ़िवादी शासन: - निरंकुश थे - आलोचना और असंतोष के प्रति असहिष्णु थे - उदारवादी आदर्शों पर अंकुश के लिए प्रेस की सेंसरशिप को अपनाया - उनकी वैधता को चुनौती देने वाले किसी भी सवाल को खारिज कर दिया रूढ़िवाद का योगदान राज्य और समाज के पारंपरिक संस्थानों जैसे राजशाही, चर्च, सामाजिक पदानुक्रम और परिवार के संरक्षण के साथ-साथ नेपोलियन द्वारा शुरू किए गए आधुनिक परिवर्तनों के संरक्षण के लिए है।', '2021-01-10 21:46:11', '2021-01-10 21:48:29'),
(673, 337, 'en', 'Question 3062 Premium on redemption of debentures account is _______.', 'According to the personal account debit the receiver, credit the giver. So, any liability will come under personal account. In this premium on Red motion of debentures is an liability so, it is a personal account.', '2021-01-10 21:46:40', '2021-01-10 21:47:25'),
(674, 337, 'hi', 'Question 3062 Premium on redemption of debentures account is _______.', 'According to the personal account debit the receiver, credit the giver. So, any liability will come under personal account. In this premium on Red motion of debentures is an liability so, it is a personal account.', '2021-01-10 21:46:40', '2021-01-10 21:47:25');
