(675, 338, 'en', 'Can you explain the answer of this question below? This a MCQ (Multiple Choice Question) based practice test of Chapter 7 - Company Accounts Issue of Debentures of Accountancy of Class XII (12) for the quick revision/preparation of School Board examinations Q  Debenture Application Account is:', 'Its a real account because debenture is a loan (liability)for the company but not for the investor. investor has given loan to company in other words he his account is credited.. (personal acct)and the other acct is debenture application acct is debited..', '2021-01-10 21:47:25', NULL),
(676, 338, 'hi', 'Can you explain the answer of this question below? This a MCQ (Multiple Choice Question) based practice test of Chapter 7 - Company Accounts Issue of Debentures of Accountancy of Class XII (12) for the quick revision/preparation of School Board examinations Q  Debenture Application Account is:', 'Its a real account because debenture is a loan (liability)for the company but not for the investor. investor has given loan to company in other words he his account is credited.. (personal acct)and the other acct is debenture application acct is debited..', '2021-01-10 21:47:25', NULL),
(677, 339, 'en', 'What territories did the Habsburg Empire rule over?', 'Names of the territory that (with some exceptions) finally became Austria-Hungary: Habsburg monarchy (1526–1867): This was an unofficial umbrella term, but very frequent, name even during that time. The entity had no official name. Austrian Empire (1804–1867): This was the official name.', '2021-01-10 21:48:29', NULL),
(678, 339, 'hi', 'हैब्सबर्ग साम्राज्य ने किन क्षेत्रों पर शासन किया?', 'इस क्षेत्र के नाम जो (कुछ अपवादों के साथ) आखिरकार आस्ट्रिया-हंगरी बन गए: हैब्सबर्ग राजशाही (1526-1867): यह एक अनौपचारिक छतरी शब्द था, लेकिन उस दौरान भी अक्सर, नाम। संस्था का कोई आधिकारिक नाम नहीं था। ऑस्ट्रियाई साम्राज्य (1804-1867): यह आधिकारिक नाम था।', '2021-01-10 21:48:29', NULL),
(679, 340, 'en', '<p>12 x 12 + 45 / 3 + 12 =&nbsp;</p>', '<p>12 x 12 + 45 / 3 + 12 =&nbsp;75</p>\r\n\r\n<p>12 x 12 = 144</p>\r\n\r\n<p>144 + 45 = 189</p>\r\n\r\n<p>189 / 3 = 63</p>\r\n\r\n<p>63 + 12 = 75</p>\r\n\r\n<p>Ans is 75</p>', NULL, NULL),
(680, 340, 'hi', '<p>12 x 12 + 45 / 3 + 12 =&nbsp;</p>', '<p>12 x 12 + 45 / 3 + 12 =&nbsp;75</p>\r\n\r\n<p>12 x 12 = 144</p>\r\n\r\n<p>144 + 45 = 189</p>\r\n\r\n<p>189 / 3 = 63</p>\r\n\r\n<p>63 + 12 = 75</p>\r\n\r\n<p>Ans is 75</p>', NULL, NULL);
