(3738, 1869, 'hi', 'गैलैंड ने दीयाब के यात्रा वृतांत से अलादीन की कहानी निकाली जिसमें वह वर्साइल के धन के साथ अपने आकर्षण की गणना करता है।', NULL, NULL),
(3739, 1870, 'en', 'The story of Aladdin has its origins in an undiscovered, incomplete manuscript of a medieval Arabic collection of stories.', NULL, NULL),
(3740, 1870, 'hi', 'अलादीन की कहानी की कहानियों की एक मध्यकालीन अरबी संग्रह की एक अनदेखा, अधूरी पांडुलिपि में इसकी उत्पत्ति है।', NULL, NULL),
(3741, 1871, 'en', 'Basing it on his own life experiences, Diyab transmitted the story of Aladdin to Galland who included it in Arabian Nights.', NULL, NULL),
(3742, 1871, 'hi', 'अपने स्वयं के जीवन के अनुभवों के आधार पर, दीयाब ने अलादीन की कहानी को गैलैंड तक पहुँचाया, जिसने इसे अरेबियन नाइट्स में शामिल किया।', NULL, NULL),
(3743, 1872, 'en', 'Galland received the story of Aladdin from Diyab who, in turn, found it in an incomplete medieval manuscript.', NULL, NULL),
(3744, 1872, 'hi', 'गैलैंड ने दीयाब से अलादीन की कहानी प्राप्त की, जिसने बदले में इसे एक अधूरी मध्ययुगीन पांडुलिपि में पाया।', NULL, NULL),
(3745, 1873, 'en', 'Diyab’s travelogue described the affluence of the French city of Bordeaux, instead of Versailles.', NULL, NULL),
(3746, 1873, 'hi', 'डायआब के यात्रा वृत्तांत ने वर्साय के बजाय फ्रांसीसी शहर बोर्डो के संपन्न होने का वर्णन किया।', NULL, NULL),
(3747, 1874, 'en', 'The French fairy tales of the eighteenth century did not have rags-to-riches plot lines like that of the tale of Aladdin.', NULL, NULL),
(3748, 1874, 'hi', 'अठारहवीं शताब्दी की फ्रांसीसी परियों की कहानियों में अलादीन की कहानी की तरह लत्ता-से-समृद्ध धन की रेखाएँ नहीं थीं।', NULL, NULL),
(3749, 1875, 'en', 'The description of opulence in Hanna Diyab’s and Antoine Galland’s narratives bore no resemblance to each other', NULL, NULL),
(3750, 1875, 'hi', 'हैना दीयाब और एंटोनी गैलैंड के आख्यानों में अपारदर्शिता का वर्णन एक दूसरे से मिलता-जुलता नहीं है', NULL, NULL),
(3751, 1876, 'en', 'Galland acknowledged in the published translations of Arabian Nights that he heard the story of Aladdin from Diyab.', NULL, NULL),
(3752, 1876, 'hi', 'गैलैंड ने अरब नाइट्स के प्रकाशित अनुवादों में स्वीकार किया कि उन्होंने दीयाब से अलादीन की कहानी सुनी।', NULL, NULL),
(3753, 1877, 'en', 'The traveller\'s experience that inspired the tale of Aladdin resonates even today.', NULL, NULL),
(3754, 1877, 'hi', 'ट्रैवलर का अनुभव जिसने अलादीन की कहानी को प्रेरित किया वह आज भी गूंजता है।', NULL, NULL),
(3755, 1878, 'en', 'The tale of Aladdin documents the history of Europe and Middle East.', NULL, NULL),
(3756, 1878, 'hi', 'अलादीन की कहानी यूरोप और मध्य पूर्व के इतिहास का दस्तावेज है।', NULL, NULL),
(3757, 1879, 'en', 'The archetype of the rags-to-riches story of Aladdin makes it popular even today.', NULL, NULL),
(3758, 1879, 'hi', 'रैगड-टू-रईस की कहानी अलादीन की कहानी इसे आज भी लोकप्रिय बनाती है।', NULL, NULL),
(3759, 1880, 'en', 'The story of Aladdin is evidence of the eighteenth century French Orientalist attitude.', NULL, NULL),
(3760, 1880, 'hi', 'अलादीन की कहानी अठारहवीं शताब्दी के फ्रांसीसी ओरिएंटलिस्ट रवैये का प्रमाण है।', NULL, NULL),
(3761, 1881, 'en', 'The narrative sensibility of Diyab’s travelogue.', NULL, NULL),
(3762, 1881, 'hi', 'दीयाब के यात्रा वृतांत की कथात्मक संवेदनशीलता।', NULL, NULL),
(3763, 1882, 'en', 'The depiction of the affluence of Versailles in Diyab’s travelogue.', NULL, NULL),
(3764, 1882, 'hi', 'दीयाब के यात्रा वृतांत में वर्साय की समृद्धि का चित्रण', NULL, NULL),
(3765, 1883, 'en', 'Galland’s acknowledgment of Diyab in his diary.', NULL, NULL),
(3766, 1883, 'hi', 'गैलैंड ने अपनी डायरी में दीयाब की स्वीकारोक्ति की।', NULL, NULL),
