(3889, 1945, 'en', '<p>Certain physical quantities are measured in terms of SI system of units. Now, a new system (NS) of units is adopted in which the speed of light <img alt=\"\" height=\"12\" src=\"https://www.digikoach.com/public/ckeditor_image/amz1_1605263698.png\" width=\"80\" />&nbsp;(in vacuum), Planck&rsquo;s constant <img alt=\"\" height=\"15\" src=\"https://www.digikoach.com/public/ckeditor_image/amz2_1605263743.png\" width=\"117\" />&nbsp;electron mass <img alt=\"\" height=\"30\" src=\"https://www.digikoach.com/public/ckeditor_image/amz3_1605263809.png\" width=\"155\" />&nbsp;and its charge <img alt=\"\" height=\"20\" src=\"https://www.digikoach.com/public/ckeditor_image/amz4_1605263867.png\" width=\"134\" />&nbsp;are the fundamental units. Thus, in list I, the units of the four physical quantities <img alt=\"\" height=\"15\" src=\"https://www.digikoach.com/public/ckeditor_image/amz5_1605263913.png\" width=\"58\" />&nbsp;and&nbsp;&nbsp;<img alt=\"\" height=\"15\" src=\"https://www.digikoach.com/public/ckeditor_image/amz6_1605263936.png\" width=\"12\" />&nbsp;</p>', NULL, NULL),
